>&nbsp;</p>\r\n<p>&ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Dịch vụ bảo tr&igrave; sửa chữa trọn g&oacute;i h&agrave;ng th&aacute;ng, h&agrave;ng năm thiết bị m&aacute;y văn ph&ograve;ng c&ocirc;ng ty.</em>&nbsp;</p>\r\n<p>&ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Tầm nh&igrave;n:&nbsp;<br />Mục ti&ecirc;u&nbsp;của ch&uacute;ng t&ocirc;i l&agrave;&nbsp;trở th&agrave;nh c&ocirc;ng ty h&agrave;ng đầu Việt nam ở thập&nbsp;kỷ tới trong lĩnh vực kinh doanh&nbsp;<br />ph&acirc;n phối v&agrave; sản xuất c&aacute;c thiết bị điện,&nbsp;điện&nbsp;tử, tin học, viễn th&ocirc;ng&hellip;<br />Ch&iacute;nh v&igrave; vậy m&agrave; ch&uacute;ng t&ocirc;i đ&atilde; x&acirc;y dựng cho m&igrave;nh chiến lược kinh doanh đến năm 2020 với những nội&nbsp;<br />dung như sau:</p>\r\n<p>&ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Triết l&iacute; kinh doanh:<br />Với phương ch&acirc;m&nbsp;<em>&ldquo;Hợp t&aacute;c để c&ugrave;ng ph&aacute;t triển&rdquo;</em>&nbsp;tập thể ban l&atilde;nh đạo&nbsp;v&agrave; c&aacute;c th&agrave;nh vi&ecirc;n trong c&ocirc;ng ty ch&uacute;ng t&ocirc;i lu&ocirc;n&nbsp;nỗ lực&nbsp;nhằm mang&nbsp;tới Qu&yacute; Kh&aacute;ch H&agrave;ng những sản phẩm h&agrave;ng ho&aacute;, dịch vụ với chất lượng cao nhất v&agrave;&nbsp;phong c&aacute;ch phục vụ tốt nhất.<br />Để đ&aacute;p ứng tốt nhất y&ecirc;u cầu ng&agrave;y c&agrave;ng cao về c&aacute;c giải ph&aacute;p v&agrave; thiết bị trong lĩnh vực trong lĩnh vực điện, điện tử nghe nh&igrave;n, thiết bị tin học viễn th&ocirc;ng, ch&uacute;ng t&ocirc;i lu&ocirc;n&nbsp;kh&ocirc;ng ngừng&nbsp;t&igrave;m t&ograve;i, ứng dụng để đưa những sản phẩm h&agrave;ng ho&aacute; với c&ocirc;ng nghệ hiện đại v&agrave; tiện &iacute;ch tới Qu&yacute; Kh&aacute;ch H&agrave;ng</p>\r\n<p>C&oacute;&nbsp;tr&igrave;nh&nbsp;độ&nbsp;chuy&ecirc;n s&acirc;u về kỹ thuật&nbsp;kết hợp với t&iacute;nh trẻ năng động, s&aacute;ng tạo, tập thể c&ocirc;ng ty Viễn Th&ocirc;ng Thi&ecirc;n Long lu&ocirc;n sẵn s&agrave;ng phục vụ Qu&yacute; Kh&aacute;ch H&agrave;ng bằng tất cả nhiệt huyết của m&igrave;nh nhằm đ&aacute;p lại sự tin tưởng m&agrave; Qu&yacute; Kh&aacute;ch H&agrave;ng đ&atilde; d&agrave;nh&nbsp;cho ch&uacute;ng t&ocirc;i.<br />Trải qua qu&aacute; tr&igrave;nh hoạt động v&agrave; ph&aacute;t triển, đến nay C&ocirc;ng ty Viễn Th&ocirc;ng Thi&ecirc;n Long đ&atilde; trưởng th&agrave;nh với đội ngũ tr&ecirc;n 20 th&agrave;nh vi&ecirc;n ch&iacute;nh thức, ngo&agrave;i ra c&ograve;n c&oacute; nhiều c&aacute;c cộng t&aacute;c vi&ecirc;n l&agrave; những người c&oacute; tr&igrave;nh độ chuy&ecirc;n m&ocirc;n cao trong c&aacute;c trường Đại học, c&aacute;c Viện Khoa học nổi tiếng trong nước.<br />Với sự hợp t&aacute;c dựa tr&ecirc;n sự tin cậy v&agrave; đầy tr&aacute;ch nhi&ecirc;m c&ugrave;ng c&aacute;c đối t&aacute;c nước ngo&agrave;i l&agrave; c&aacute;c H&atilde;ng sản xuất, c&aacute;c nh&agrave; cung cấp thiết bị tr&ecirc;n to&agrave;n thế giới. C&ocirc;ng Viễn Th&ocirc;ng Thi&ecirc;n Long đ&atilde; lựa chọn, ph&aacute;t triển v&agrave; cung cấp rất nhiều sản phẩm c&ocirc;ng nghệ cao đến Qu&yacute; Kh&aacute;ch H&agrave;ng ở khắp c&aacute;c tỉnh th&agrave;nh trong cả nước.</p>\r\n<p>SƠ ĐỒ TỔ CHỨC C&Ocirc;NG TY:</p>\r\n<p>&ndash; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hội đồng quản trị:<br />Hội đồng quản trị l&agrave; những th&agrave;nh vi&ecirc;n t&acirc;m huyết tham gia g&oacute;p vốn v&agrave;o cty. L&agrave; những người kh&ocirc;ng thể t&aacute;ch rời c&ocirc;ng ty lu&ocirc;n tham gia những cuộc họp định kỳ b&agrave;n luận đ&oacute;ng g&oacute;p &yacute; kiến bổ &iacute;ch thiết thực cho tập thể l&atilde;nh đạo c&ocirc;ng ty.Gi&uacute;p ban l&atilde;nh đạo c&ocirc;ng ty lu&ocirc;n đi đ&uacute;ng hướng tr&ecirc;n con đường ph&aacute;t triển.<br />&ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ban gi&aacute;m đốc:<br />Ban gi&aacute;m đốc c&ocirc;ng ty gồm c&oacute; Gi&aacute;m đốc v&agrave; c&aacute;c Ph&oacute; gi&aacute;m đốc phụ tr&aacute;ch chuy&ecirc;n m&ocirc;n, gi&uacute;p Gi&aacute;m đốc c&ocirc;ng ty trong qu&aacute; tr&igrave;nh điều h&agrave;nh hoạt động sản xuất kinh doanh. Ban gi&aacute;m đốc c&ocirc;ng ty l&agrave; những người được đ&agrave;o tạo cơ bản, am hiểu về kinh doanh v&agrave; lĩnh vực hoạt động được giao trực tiếp quản l&yacute; một số bộ phận. C&aacute;c l&atilde;nh đạo c&ocirc;ng ty đều thấu hiểu r&otilde; nhiệm vụ v&agrave; mục ti&ecirc;u của c&ocirc;ng ty l&agrave; đưa c&ocirc;ng ty ng&agrave;y c&agrave;ng ph&aacute;t triển v&agrave; thịnh vượng.&nbsp; Sự định hướng v&agrave; ph&aacute;t triển c&ocirc;ng ty dựa tr&ecirc;n sự điều h&agrave;nh của ban Gi&aacute;m đốc.<br />&ndash; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Gi&aacute;m đốc c&ocirc;ng ty:<br />Gi&aacute;m đốc c&ocirc;ng ty,&nbsp;người do hội đồng s&aacute;ng lập vi&ecirc;n bổ nhiệm, chịu tr&aacute;ch nhiệm điều h&agrave;nh trực tiếp mọi hoạt động sản xuất kinh doanh của c&ocirc;ng ty.&nbsp;<br />Gi&aacute;m đốc c&ocirc;ng ty đ&atilde; được đ&agrave;o tạo chuy&ecirc;n s&acirc;u về chuy&ecirc;n ng&agrave;nh v&agrave; trải qua nhiều năm kinh nghiệm trong c&ocirc;ng t&aacute;c quản l&yacute; v&agrave; điều h&agrave;nh, tham gia chỉ đạo trực tiếp nhiều dự &aacute;n đạt th&agrave;nh c&ocirc;ng về chất lượng v&agrave; tiến độ được kh&aacute;ch h&agrave;ng ghi nhận v&agrave; đ&aacute;nh gi&aacute; cao<br />Gi&aacute;m đốc c&ocirc;ng ty chịu tr&aacute;ch nhiệm trước hội đồng s&aacute;ng lập vi&ecirc;n về việc thực hiện c&aacute;c quyền v&agrave; nghĩa vụ được giao, gi&uacute;p việc cho Gi&aacute;m đốc gồm c&oacute; c&aacute;c trưởng c&aacute;c ph&ograve;ng, bộ phận thuộc cả khối kinh doanh cũng như khối h&agrave;nh ch&iacute;nh.<br />&ndash; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; C&aacute;c ph&ograve;ng ban trong c&ocirc;ng ty:<br />&ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Ph&ograve;ng kinh doanh ph&acirc;n phối:</em><br />Ph&ograve;ng Kinh doanh ph&acirc;n phối c&oacute; chức năng ph&acirc;n phối c&aacute;c sản phẩm của c&ocirc;ng ty tới c&aacute;c đối t&aacute;c, bạn h&agrave;ng với gi&aacute; cả theo phương thức gi&aacute; sỉ.<br />Dựa tr&ecirc;n k&ecirc;nh ph&acirc;n phối n&agrave;y, ph&ograve;ng kinh doanh ph&acirc;n phối c&oacute; vai tr&ograve; chủ đạo trong việc ph&aacute;t triển v&agrave; đưa c&aacute;c sản phẩm đ&atilde; được định hướng tới kh&aacute;ch h&agrave;ng một c&aacute;ch rộng nhất.<br />&ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Ph&ograve;ng kinh doanh b&aacute;n lẻ:</em><br />Ph&ograve;ng Kinh b&aacute;n lẻ c&oacute; chức năng cung cấp c&aacute;c thiết bị, h&agrave;ng ho&aacute; của C&ocirc;ng ty tới Kh&aacute;ch h&agrave;ng một c&aacute;ch trực tiếp.<br />Dựa tr&ecirc;n k&ecirc;nh b&aacute;n h&agrave;ng n&agrave;y, ph&ograve;ng kinh doanh b&aacute;n lẻ c&oacute; vai tr&ograve; chủ đạo trong việc đem lại quyền lợi tới kh&aacute;ch h&agrave;ng một c&aacute;ch nhanh nhất, hiểu r&otilde; được nhu cầu sử dụng của kh&aacute;ch về c&aacute;c thiết bị sản phẩm m&agrave; c&ocirc;ng ty cung cấp.<br />Dựa v&agrave;o đ&oacute;, c&ocirc;ng ty sẽ c&oacute; những điều chỉnh kịp thời về mẫu m&atilde;, gi&aacute; cả, t&iacute;nh năng kỹ thuật của h&agrave;ng ho&aacute; cho ph&ugrave; hợp với nhu cầu sử dụng của kh&aacute;ch h&agrave;ng đối với những sản phẩm m&agrave; c&ocirc;ng ty cung cấp.<br />&ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Ph&ograve;ng kinh doanh dự &aacute;n:&nbsp;</em><br />Ph&ograve;ng kinh doanh dự &aacute;n, c&oacute; vai tr&ograve; l&agrave; x&acirc;y dựng chiến lược kinh doanh v&agrave; c&aacute;c ch&iacute;nh s&aacute;ch kinh doanh c&aacute;c thiết bị h&agrave;ng ho&aacute; ph&ugrave; hợp với từng thời kỳ, thời điểm theo nhu cầu của kh&aacute;ch h&agrave;ng.<br />Ph&ograve;ng kinh doanh dự &aacute;n thực thi triển khai c&aacute;c dự &aacute;n từ c&aacute;c kh&acirc;u tư vấn, thiết kế đến triển khai dự &aacute;n đảm bảo dự &aacute;n th&agrave;nh c&ocirc;ng v&agrave; đạt được mong muốn của c&aacute;c kh&aacute;ch h&agrave;ng.<br />Ph&ograve;ng Kinh doanh c&oacute; tr&aacute;ch nhiệm lập kế hoạch kinh doanh cho hoạt động kinh doanh ngắn hạn, trung hạn, d&agrave;i hạn của c&ocirc;ng ty v&agrave; kiểm tra, gi&aacute;m s&aacute;t qu&aacute; tr&igrave;nh thực hiện.<br />&ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Ph&ograve;ng Marketing:</em><br />Điều tra, nghi&ecirc;n cứu nhu cầu kh&aacute;ch h&agrave;ng, nhu cầu của thị trường.<br />Lập kế hoạch x&acirc;y dựng v&agrave; ph&aacute;t triển thương hiệu c&ocirc;ng ty.&nbsp;<br />Thực hiện kế hoạch ph&aacute;t triển thương hiệu.<br />X&uacute;c tiến, quảng b&aacute; v&agrave; ph&aacute;t triển c&aacute;c sản phẩm m&agrave; c&ocirc;ng ty c&oacute; kế hoạch triển khai ph&acirc;n phối, cũng như sản xuất v&agrave;o thị trường.<br />C&oacute; chức năng nghi&ecirc;n cứu, tham mưu, tư vấn v&agrave; tham gia đ&agrave;o tạo c&aacute;c vấn đề về thị trường c&ocirc;ng nghệ th&ocirc;ng tin, điện, điện tử, điện lạnh v&agrave; c&aacute;c thiết bị điện, điện tử, tin học, viễn th&ocirc;ng, điều khiển tự động, an ninh bảo vệ, thiết bị trường học, thiết bị &acirc;m thanh, truyền h&igrave;nh v&agrave; c&aacute;c thiết bị chuy&ecirc;n dụng kh&aacute;c &hellip;<br />&ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Ph&ograve;ng thi c&ocirc;ng c&ocirc;ng tr&igrave;nh:</em><br />Chịu tr&aacute;ch nhiệm khảo s&aacute;t mặt bằng thi c&ocirc;ng l&ecirc;n dự to&aacute;n vật tư phụ kiện v&agrave; c&aacute;c thiết bị m&aacute;y m&oacute;c hỗ trợ t&aacute;c nghiệp thi c&ocirc;ng . Lập kế hoạch thời gian thi c&ocirc;ng cũng như&nbsp; điều phối nh&acirc;n lực tham dự c&ocirc;ng tr&igrave;nh một c&aacute;h hợp l&yacute; v&agrave; hiệu quả nhất. theo d&otilde;i v&agrave; gi&aacute;m s&aacute;t c&ocirc;ng tr&igrave;nh từ khi thi c&ocirc;ng đến khi ho&agrave;n thiện v&agrave; b&agrave;n giao cho kh&aacute;ch h&agrave;ng sử dụng. ho&agrave;n th&agrave;nh thủ tục ho&agrave;n c&ocirc;ng v&agrave; số liệu gửi ph&ograve;ng kế to&aacute;n l&agrave;m thủ tục thanh to&aacute;n v&agrave; thanh l&yacute; hợp đồng.<br />&ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Ph&ograve;ng kỹ thuật:</em><br />Ph&ograve;ng kỹ thuật c&oacute; nhiệm vụ hỗ trợ Gi&aacute;m đốc về mặt kỹ thuật.<br />Ph&ograve;ng n&agrave;y c&oacute; 2 nhiệm vụ ch&iacute;nh đ&oacute; l&agrave; nghi&ecirc;n cứu c&ocirc;ng nghệ mới, triển khai thiết kế v&agrave; lắp đặt thiết bị .<br />Lĩnh vực thiết kế: Thiết kế những hệ thống điện tử, viễn th&ocirc;ng&hellip;cung cấp cho kh&aacute;ch h&agrave;ng, đảm bảo t&iacute;nh hiệu quả v&agrave; an to&agrave;n của to&agrave;n bộ hệ thống được lắp đặt.<br />Bộ phận lắp đặt c&oacute; nhiệm vụ lắp đặt v&agrave; ho&agrave;n thiện hệ thống theo đ&uacute;ng như thiết kế thực hiện đ&uacute;ng c&aacute;c th&ocirc;ng số về an to&agrave;n v&agrave; kỹ thuật.<br />&ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Trung t&acirc;m bảo h&agrave;nh v&agrave; hỗ trợ kỹ thuật kh&aacute;ch h&agrave;ng:</em><br />Chức năng v&agrave; nhiệm vụ của trung t&acirc;m bảo h&agrave;nh hay c&ograve;n gọi l&agrave; ph&ograve;ng bảo h&agrave;nh chỉ thuần tu&yacute; về mặt kỹ thuật. Định kỳ hoặc khi c&oacute; y&ecirc;u cầu của c&ocirc;ng ty, ph&ograve;ng bảo h&agrave;nh sẽ tiến h&agrave;nh c&ocirc;ng t&aacute;c bảo h&agrave;nh định kỳ cho kh&aacute;ch h&agrave;nh tại nơi lắp đặt hoặc kh&aacute;ch h&agrave;ng mang thiết bị đến trực tiếp trung t&acirc;m để bảo h&agrave;nh.<br />&ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Ph&ograve;ng h&agrave;nh ch&iacute;nh nh&acirc;n sự:</em><br />X&acirc;y dựng c&aacute;c quy tr&igrave;nh quản l&yacute; nội bộ, c&aacute;c ti&ecirc;u chuẩn v&agrave; c&aacute;c chuẩn mực c&ocirc;ng việc.<br />Hoạch định v&agrave; kiểm so&aacute;t c&ocirc;ng việc thực hiện c&aacute;c quy định, quy tr&igrave;nh nghiệp vụ của c&ocirc;ng ty v&agrave; thực hiện qua hệ thống kiểm so&aacute;t nội bộ gi&uacute;p ban l&atilde;nh đạo c&ocirc;ng ty kiểm so&aacute;t được v&agrave; đ&aacute;nh gi&aacute; đ&uacute;ng.<br />Ph&ograve;ng H&agrave;nh ch&iacute;nh &ndash; Nh&acirc;n sự chịu tr&aacute;ch nhiệm tổ chức c&ocirc;ng việc h&agrave;nh ch&iacute;nh theo đ&uacute;ng quy định của ph&aacute;p luật Việt Nam v&agrave; c&aacute;c quy định kh&aacute;c c&oacute; li&ecirc;n quan.&nbsp;<br />Đồng thời, ph&ograve;ng cũng quản l&yacute; to&agrave;n bộ c&aacute;n bộ c&ocirc;ng nh&acirc;n vi&ecirc;n trong c&ocirc;ng ty.&nbsp;<br />Ph&ograve;ng thực hiện c&aacute;c nghiệp vụ như tuyển dụng nh&acirc;n vi&ecirc;n, chấm dứt hợp đồng lao động, bố tr&iacute; nh&acirc;n vi&ecirc;n v&agrave;o c&aacute;c vị tr&iacute; c&ocirc;ng việc theo đ&uacute;ng năng lực v&agrave; tr&igrave;nh độ để qu&aacute; tr&igrave;nh sử dụng lao động đạt được hiệu quả cao nhất.<br />Ph&ograve;ng cũng lập c&aacute;c kế hoạch đ&agrave;o tạo chuy&ecirc;n s&acirc;u đối với những c&aacute;n bộ thật sự c&oacute; năng lực, lập c&aacute;c kế hoạch khen thưởng xứng đ&aacute;ng.<br />&ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Ph&ograve;ng t&agrave;i ch&iacute;nh kế to&aacute;n:</em><br />Kế to&aacute;n t&agrave;i ch&iacute;nh l&agrave; trung t&acirc;m th&ocirc;ng tin để phục vụ c&ocirc;ng t&aacute;c quản l&yacute; v&agrave; điều h&agrave;nh của Ban l&atilde;nh đạo c&ocirc;ng ty, với chức năng l&agrave; thống k&ecirc;, ghi ch&eacute;p v&agrave; gi&aacute;m s&aacute;t to&agrave;n bộ hoạt động kinh doanh của c&ocirc;ng ty.&nbsp;<br />Ph&acirc;n t&iacute;ch v&agrave; dự b&aacute;o về t&igrave;nh h&igrave;nh vốn v&agrave; sử dụng vốn để gi&aacute;m đốc c&ocirc;ng ty quyết định c&aacute;c ch&iacute;nh s&aacute;ch kinh doanh ph&ugrave; hợp.<br />Lập c&aacute;c kế hoạch về t&agrave;i ch&iacute;nh, tư vấn Gi&aacute;m đốc c&ocirc;ng ty về lĩnh vực t&agrave;i ch&iacute;nh phục vụ tốt c&ocirc;ng t&aacute;c kinh doanh đạt hiệu quả.<br />&ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Bộ phận quản trị nội bộ:</em><br />X&acirc;y dựng c&aacute;c ch&iacute;nh s&aacute;ch quản l&yacute; nội bộ đảm bảo khuyến kh&iacute;ch v&agrave; mang lại hiệu quả cho c&ocirc;ng ty v&agrave; người lao động.<br />Tổ chức quản l&yacute; thực hiện c&ocirc;ng t&aacute;c t&agrave;i ch&iacute;nh kế to&aacute;n theo từng ch&iacute;nh s&aacute;ch của nh&agrave; nước, đảm bảo nguồn vốn cho sản xuất kinh doanh v&agrave; y&ecirc;u cầu ph&aacute;t triển của c&ocirc;ng ty, ph&acirc;n t&iacute;nh v&agrave; tổng hợp số liệu để đ&aacute;nh gi&aacute; kết quả sản xuất kinh doanh. Đề xuất c&aacute;c biện ph&aacute;p đảm bảo hoạt động của c&ocirc;ng ty c&oacute; hiệu quả.<br />Theo d&otilde;i v&agrave; dự b&aacute;o những sự&nbsp; biến động của vốn, của t&agrave;i sản&hellip;<br />Ph&acirc;n t&iacute;ch v&agrave; t&iacute;nh to&aacute;n ch&iacute;nh x&aacute;c kết quả hoạt động kinh doanh của c&ocirc;ng ty.<br />Tổng hợp số liệu t&igrave;nh h&igrave;nh t&agrave;i ch&iacute;nh của đơn vị trong từng thời kỳ cụ thể, b&aacute;o c&aacute;o l&ecirc;n gi&aacute;m đốc c&ocirc;ng ty để từ đ&oacute; c&oacute; những quyết s&aacute;ch kịp thời v&agrave; th&iacute;ch hợp.&nbsp;<br />&ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Ph&ograve;ng quản l&iacute; v&agrave; chăm s&oacute;c kh&aacute;ch h&agrave;ng:</em><br />R&agrave; so&aacute;t, quản l&yacute;, ph&aacute;t triển kh&aacute;ch h&agrave;ng tiềm năng, kh&aacute;ch h&agrave;ng truyền thống của c&ocirc;ng ty.<br />L&agrave;m c&aacute;c c&ocirc;ng việc m&agrave; bộ phận b&aacute;n h&agrave;ng đ&atilde; hứa sẽ cung cấp cho kh&aacute;ch h&agrave;ng sử dụng sản phẩm v&agrave; dịch vụ của c&ocirc;ng ty.&nbsp;<br />Bao gồm việc lập kế hoạch chăm s&oacute;c, l&ecirc;n danh s&aacute;ch c&aacute;c dịch vụ sẽ cung cấp cho kh&aacute;ch h&agrave;ng v&agrave; theo d&otilde;i sự vận h&agrave;nh của c&aacute;c thiết bị, từ đ&oacute; c&oacute; những biện ph&aacute;p duy tu, bảo dưỡng nhất định v&agrave; ph&ugrave; hợp nhất</p>\r\n<p><em>Với khả năng chuy&ecirc;n s&acirc;u về kỹ thuật, kết hợp với t&iacute;nh tuổi trẻ năng động, s&aacute;ng tạo của đội ngũ th&agrave;nh vi&ecirc;n trong C&ocirc;ng ty. Với phương ch&acirc;m &ldquo;Hợp t&aacute;c c&ugrave;ng ph&aacute;t triển&rdquo; C&ocirc;ng ty&nbsp;</em>Viễn Th&ocirc;ng Thi&ecirc;n Long<em>&nbsp;lu&ocirc;n phấn đấu hết m&igrave;nh để mang đến Qu&yacute; Kh&aacute;ch H&agrave;ng những sản phẩm v&agrave; dịch vụ tối ưu nhất.</em></p>\r\n<p><em>Với 2 ng&agrave;nh nghề ch&iacute;nh , kết hợp giữa truyền thống v&agrave; hiện đại ch&uacute;ng t&ocirc;i đang từng bước x&acirc;y dựng l&ecirc;n một tập thể C&ocirc;ng Ty&nbsp;</em>Viễn Th&ocirc;ng Thi&ecirc;n Long<em>&nbsp;ng&agrave;y c&agrave;ng vững mạnh cả về chất v&agrave; lượng. Dưới sự quản trị&nbsp; định hướng của ban l&atilde;nh đạo trẻ tuổi, năng động , s&aacute;ng tạo v&agrave; kinh nghiệm đầu tư kinh doanh d&agrave;i hạn của hội đồng quản trị, ch&uacute;ng t&ocirc;i&nbsp; tin tưởng v&agrave;o một tương lai kh&ocirc;ng xa Thi&ecirc;n Long sẽ&nbsp; trở th&agrave;nh một tập đo&agrave;n&nbsp; kinh tế ph&aacute;t triển lớn mạnh v&agrave; bền vững của Việt Nam.</em></p>',NULL,NULL,85,85,NULL,'2021-11-14 20:58:04','2021-11-14 20:58:04'),(57,2,337,10,NULL,'Công Ty TNHH GSHN','0563635489','Nguyễn Thành Đô','0984.483.679','cong-ty-tnhh-gshn','http://giangsancom.com/','4101489338','660 Trần Phú, TT. Bình Định, An Nhơn, Bình Định',NULL,'<p>Trong những năm gần đ&acirc;y, c&ocirc;ng nghiệp h&oacute;a v&agrave; hiện đại h&oacute;a kh&ocirc;ng ngừng ph&aacute;t triển một c&aacute;ch mạnh mẽ v&agrave; hiện đại. Với xu thế to&agrave;n cầu h&oacute;a nền kinh tế thế giới, đặc biệt l&agrave; nhu cầu trao đổi h&agrave;ng h&oacute;a của con người n