">L&agrave; đối t&aacute;c đ&agrave;o tạo ủy quyền Platinum Approved Training Partner (ATP) tại thị trường Việt Nam của tổ chức LPI (https://www.lpi.org/) ,TEL4VN hiện cung cấp:</span></p>\r\n<ul>\r\n<li><strong>Đ&agrave;o tạo Linux LPI</strong>\r\n<ul>\r\n<li>Linux LPIC-1</li>\r\n<li>Linux LPIC-2</li>\r\n<li>Linux LPIC-3</li>\r\n</ul>\r\n</li>\r\n<li><strong>Đ&agrave;o tạo DevOps</strong>:\r\n<ul>\r\n<li>Container Docker &ndash; Kubernetes</li>\r\n<li>Jenkins CI/CD</li>\r\n<li>Ansible</li>\r\n<li>Gi&aacute;m s&aacute;t hệ thống: Grafana &ndash; Prometheus, Zabbix</li>\r\n<li>Log Management: ELK</li>\r\n<li>Cloud Computing</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li><strong>Đ&agrave;o tạo VoIP</strong>:\r\n<ul>\r\n<li>VoIP Admin: x&acirc;y dựng v&agrave; triển khai tổng đ&agrave;i VOIP doanh nghiệp</li>\r\n<li>VoIP Advanced: triển khai, vận h&agrave;nh khai th&aacute;c hệ thống Cloud PBX &ndash; tổng đ&agrave;i ảo</li>\r\n<li>VoIP Dev: t&iacute;ch hợp VoIP v&agrave;o Web/CRM/ERP sử dụng c&ocirc;ng nghệ WebRTC</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><span class=\"s1\">TEL4VN mang đến cho Học vi&ecirc;n một m&ocirc;i trường học tập l&yacute; tưởng:</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&ndash; Thiết bị đầy đủ v&agrave; hiện đại.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&ndash; Chương tr&igrave;nh cập nhật li&ecirc;n tục, bảo đảm cho học vi&ecirc;n lu&ocirc;n tiếp cận với những c&ocirc;ng nghệ mới nhất.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&ndash; Giảng vi&ecirc;n c&oacute; nhiều kinh nghiệm triển khai hệ thống.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&ndash; Nhận thực tập, hướng dẫn đồ &aacute;n tốt nghiệp miễn ph&iacute; cho c&aacute;c bạn sinh vi&ecirc;n.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&ndash; Hỗ trợ đầu ra th&ocirc;ng qua c&aacute;c doanh nghiệp CNTT, Viễn th&ocirc;ng v&agrave; VNPT</span></p>',NULL,NULL,393,393,NULL,'2021-11-17 15:51:38','2021-11-17 16:10:10'),(182,14,405,3,NULL,'CÔNG TY TNHH GIẢI PHÁP VIỄ