s.','Công việc được giao:\r\n- Tìm hiểu Redux saga.\r\n	\r\nNội dung – kết quả đạt được:\r\n- Đã tìm hiểu được cơ bản về Redux saga.','Công việc được giao:\r\n-  Tìm hiểu  Laravel, CMS botble.\r\n	\r\nNội dung – kết quả đạt được:\r\n- Chưa tìm hiểu được cơ bản về CMS botble. Trước đó Laravel đã được tìm hiểu ở trên trường.','Công việc được giao:\r\n- Api, Gitlab\r\n	\r\nNội dung – kết quả đạt được:\r\n- Đã tìm hiểu được cơ bản về luồng chạy của api, Cách lệnh cơ bản của gitlab, tuy nhiên việc sử dụng các câu lệnh vẫn còn khó khăn','Công việc được giao:\r\n- Làm dự án demo, Có các chức năng đăng nhập, đăng kí, đăng xuất.\r\ntừ FE gọi api gửi dữ liệu lên server BE , có các chức năng thêm sửa xóa account.\r\n- Làm giao diện login, register\r\n\r\n	\r\nNội dung – kết quả đạt được:\r\n- Đã làm xong giao diện Đăng nhập, Đăng kí','Công việc được giao:\r\n- Làm giao diện thông tin người dùng, Tạo plugin bên botble cms.\r\n	\r\nNội dung – kết quả đạt được:\r\n- Đã làm xong giao diện Thông tin người dùng\r\n- Đã tạo xong plugin Botble CMS',NULL,NULL,327,327,NULL,'2021-11-15 11:03:30','2021-11-15 11:03:30'),(121,84,'2/8/2021','8/8/2021','Công việc được giao:\r\n-Tìm hiểu về Postman.\r\n- BE : Tìm hiểu kĩ hơn về botble\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã tìm hiểu được cơ bản về Postman.\r\n- Đã tìm hiểu được cách tạo các table để nhập các trường dữ liệu bên phía admin.\r\n- Đã biết tạo và viết các api.','Công việc được giao:\r\n- BE : Mã hóa password và Tạo token.\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã mã hóa được password theo dạng md5. Và login thành công sẽ tạo ra token','Công việc được giao:\r\n- BE : Viết các api lấy dữ liệu cho phần Login và Register, Account.\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã viết được các api cho phần đăng kí, Đăng nhập, Thông tin ngừoi dùng','Công việc được giao:\r\n- FE : Gọi được api từ BE.\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành chức năng đăng kí, đăng nhập. Khi đăng nhập thành công thì tạo ra token.','Công việc được giao:\r\n- FE : Làm chức năng hiển thị thông tin của Người dùng. Kiểm tra token nếu chưa có thì trả về trang đăng nhập.\r\n- BE : Viết API lấy thông tin ngừoi dùng.\r\n\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành, khi đăng nhập thành công sẽ chuyển đến trang thông tin người dùng. Và thông tin người dùng sẽ hiển thị lên các form.','Công việc được giao:\r\n-- BE : Viết api update thông tin người dùng, mật khẩu, lấy thông tin của người dùng\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã viết được api update thông tin, sửa password và thông tin người dùng.',NULL,NULL,327,327,NULL,'2021-11-15 11:04:21','2021-11-15 11:06:51'),(122,84,'9/8/2021','15/8/2021','Công việc được giao:\r\n- FE :Cho phép người dùng sửa được thông tin, và password khi nhập vào từ bàn phím.\r\n-FE : Tạo thêm các validator\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành, khi người dùng sửa thông tin và password, sẽ trả về trang đăng nhập, đăng nhập thành công thì thông tin mới sẽ hiển thị lên.','Công việc được giao:\r\n- BE : Viết api đăng xuất, api đăng nhập cho admin và api hiển thị thông tin các người dùng.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã viết được các api và test qua postman.','Công việc được giao:\r\n- FE : Tạo layout cho trang đăng nhập và hiển thị thông tin các người dùng trong phần admin.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành các layout.','Công việc được giao:\r\n- FE : Khi đăng nhập bằng tài khoản admin sẽ chuyển đến trang thông tin các người dùng, và hiển thị tất cả người dùng.\r\n- FE : Chức năng đăng xuất\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã gọi được api và hoàn thành chức năng, khi đăng nhập bằng tài khoản admin thành công thì sẽ trả về các list người dùng, khi nhấn đăng xuất sẽ xóa token và trả về trang đăng nhập admin.','Công việc được giao:\r\n- BE : Viết API sửa, xóa thông tin ngừoi dùng trong phần admin.\r\n- FE : Tạo các nút xóa, sửa trong từng mục người dùng.\r\n- FE : Làm chức năng xóa sửa thông tin.\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành các api, và các button.\r\n- Đã hoàn thành khi click vào button xóa, sửa thì sẽ xóa, sửa người dùng và cập nhật lên db và hiển thị lên giao diện.','Công việc được giao:\r\n- FE : Làm reponsive\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã viết được các reponsive cho các thiết bị mobile và table',NULL,NULL,327,327,NULL,'2021-11-15 11:09:40','2021-11-15 11:09:40'),(123,84,'16/8/2021','22/8/2021','Công việc được giao:\r\n- BÁO CÁO ĐỒ ÁN QUẢN LÝ USER.\r\n\r\nNội dung – kết quả đạt được:\r\n- Buổi báo cáo đã hoàn thành tốt đẹp, trao đổi thêm về kiến thức và những điều cần khắc phục, công nghệ mới cho dự tiếp theo.','Công việc được giao:\r\n- Nhận dự án wedsite blog cho phép người dùng xem, đọc bài, đăng kí thành viên để tạo và quản lý bài viết của mình, có chức năng đánh giá, lượt view.','Công việc được giao:\r\n- Tìm hiểu thêm về React Hooks\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã tìm hiểu cơ bản về react hooks','Công việc được giao:\r\n- Tìm hiểu thêm về tailwincss\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã tìm hiểu cơ bản về tailwincss','Công việc được giao:\r\n- Tìm hiểu về laravel passport\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã tìm hiểu cơ bản về laravel passport','Công việc được giao:\r\n- Hoàn thành các component chung Header, Footer. Khi click trả về trang tương ứng.\r\n\r\nNội dung – kết quả đạt được:\r\n- Header thì gồm có avt, danh mục, danh sách bài viết đăng xuất, đăng kí đăng nhập, khi click trả về trang tương ứng',NULL,NULL,327,327,NULL,'2021-11-15 11:12:14','2021-11-15 11:12:14'),(124,84,'23/8/2021','29/8/2021','Công việc được giao:	\r\n- Làm layout Trang Chủ và Reponsive.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành 70% giao diện.','Công việc được giao:	\r\n- Làm layout Trang Chủ và Reponsive.\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành giao diện và reponsive.','Công việc được giao:	\r\n- Làm layout Trang danh bài viết và Reponsive.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành 70% giao diện.','Công việc được giao:	\r\n- Làm layout Trang danh bài viết và Reponsive.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành giao diện và reponsive.','Công việc được giao:	\r\n- Gọi api hoàn thành chức năng render thành viên nổi bật, bài viết nổi bật của Trang chủ.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã gọi và render được thành viên nổi bật, các bài viết nổi bật','Công việc được giao:	\r\n- Gọi api và hoàn thành chức danh mục thường gặp hiển thị trên thanh header kiểu dropdown của Trang chủ.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành khi click vào sẽ hiển thị các danh mục nổi bật của bài viết.',NULL,NULL,327,327,NULL,'2021-11-15 11:12:38','2021-11-15 11:14:39'),(125,84,'29/8/2021','3/9/2021','Công việc được giao:	\r\n- Gọi api hoàn thành chức năng render bài viết nổi bật,    danh mục thường gặp hiển thị trên thanh header kiểu dropdown của Trang danh sách bài viết.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã gọi và render được thành viên nổi bật, các bài viết nổi bật.\r\n- Đã hoàn thành khi click vào sẽ hiển thị các danh mục nổi bật của bài viết.','Công việc được giao:	\r\n- Làm layout cho Trang chi tiết bài viết và reponsive.\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành giao diện và reponsive','Công việc được giao:	\r\n- Gọi api hoàn thành chức năng render bài viết liên quan của Trang chi tiết bài viết, Bài viết liên quan, sao trung bình, lượt xem.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn Thành render chi tiết bài viết, bài viết liên quan, sao trung bình, lượt xem của bài viết, tác giả, ngày viết .','Công việc được giao:	\r\n- Làm chức năng đánh giá, bình luận, hiển thị lượt xem, sao đánh giá.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành, khi đánh giá xong, sẽ hiển thị thông tin đánh giá dưới phần bình luận kèm sao và avt người đánh giá.','Công việc được giao:	\r\n- Xử lý khi render hình ảnh, và liên kết các trang tương ứng.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành render và xử lý hình ảnh. Tạo các đường liên kết cho các trang khi click vào avt, bài viết, bài viết nổi bật, sẽ trả về các trang tương ứng.','Công việc được giao:	\r\n- BÁO CÁO ĐỒ ÁN WEDSITE BLOG\r\n\r\nNội dung – kết quả đạt được:\r\n- Buổi báo cáo đã hoàn thành tốt đẹp, trao đổi thêm về kiến thức và những điều cần khắc phục.',NULL,NULL,327,327,NULL,'2021-11-15 11:15:03','2021-11-15 11:18:26'),(127,87,'26/7/2021','31/7/2021','Nhận Công Việc\r\nTìm hiểu công cụ Figma\r\nKết quả:Tìm hiểu được cách hoạt động, cài đặt, cơ bản chức năng của Figma','Vẽ layout bằng Figma, Tìm hiểu AI,Illustartor\r\nKết quả:Vẽ 2 Layout bằng Figma: Mobile và Trang Blog và Tìm hiểu cơ bản về 2 phần mềm AI,Illustartor','Vẽ Layout Web bằng Figma\r\nKết quả: Hoàn thành Vẽ layout web shopee và Đặt món ăn','Vẽ Layout Web Shopee bằng Figma','Vẽ Layout Web Shopee bằng Figma\r\nKết quả: Sửa khoảng cách và vẽ lại các Icon, Vector','Vẽ Layout Web Shopee bằng Figma\r\nHoàn thành Trang Shopee',NULL,NULL,276,276,NULL,'2021-11-15 11:24:05','2021-11-15 11:27:13'),(128,87,'02/08/2021','07/08/2021','Nhiệm Vụ: Sửa lại khoảng cách, Bố cục của trang Shopee','Nhiệm Vụ:Nhận Công Việc mới từ anh Huy,Bắt đầu làm việc nhóm, code Email Table','Nhiệm Vụ: code Email Table','Nhiệm Vụ: Gộp code, sử dụng JavaScript để chuyển trang Xem lại bài, Nộp bài và đợi nhận Xét, Học thêm các Html css từ trên mạng','Nhiệm Vụ: Báo cáo cuối Tuần','Đợi nhận Nhiệm Vụ mới',NULL,NULL,276,276,NULL,'2021-11-15 11:28:00','2021-11-15 11:29:50'),(129,87,'09/08/2021','14/08/2021','Nhiệm Vụ: Đợi Nhận Công Việc, Chỉnh sửa Code','Nhiệm Vụ: Viết Báo Cáo','Nhiệm Vụ: Nhận công việc Từ Anh Huy, Thiết kế layout Corevestor Web','Nhiệm Vụ: Thiết kế layout Corevestor Web','Nhiệm Vụ: Thiết kế layout Corevestor Web, Chỉnh sửa.','Nhiệm vụ: Thiết kế layout Corevestor Web ,Báo cáo cuối Tuần',NULL,NULL,276,276,NULL,'2021-11-15 11:30:51','2021-11-15 11:32:15'),(130,87,'16/08/2021','21/08/2021','Nhiệm Vụ: Chỉnh sửa Layout theo đúng chuẩn theo yêu cầu anh Huy