một giao diện đẹp','Tiếp tục chỉnh sửa lại đường dẫn link sao cho đẹp hơn','Tiếp tục sửa giao diện của kho giao diện cho đúng yêu cầu','Tiếp tục sửa giao diện của kho giao diện cho đúng yêu cầu','Tiếp tục sửa giao diện của kho giao diện cho đúng yêu cầu.\r\n\"Chỉ thực tập sáng thứ 7\".',NULL,NULL,204,204,NULL,'2021-11-15 14:52:11','2021-11-15 14:58:00'),(167,8,'06/09/2021','11/09/2021','Tiếp tục sửa và hoàn thành sửa giao diện của kho giao diện cho đúng yêu cầu','Tiếp tục sửa và hoàn thành sửa giao diện của kho giao diện cho đúng yêu cầu','Tiếp tục sửa và hoàn thành sửa giao diện của kho giao diện cho đúng yêu cầu','Hoàn thành sửa giao diện của kho giao diện cho đúng yêu cầu','Sửa lại những chỗ không hoàn hảo của sourcode','Sửa lại những chỗ không hoàn hảo của sourcode,\r\n\"Chỉ thực tập sáng thứ 7\".',NULL,NULL,204,204,NULL,'2021-11-15 14:54:31','2021-11-15 14:58:12'),(168,8,'13/09/2021','18/09/2021','Tìm kiếm, sửa lỗi, hoàn thành dự án cho công ty','Tìm kiếm, sửa lỗi, hoàn thành dự án cho công ty','Tìm kiếm, sửa lỗi, hoàn thành dự án cho công ty','Chờ thông báo từ sếp và hoàn thành công việc thực tập','Chờ thông báo từ sếp và hoàn thành công việc thực tập','Chờ thông báo từ sếp và hoàn thành công việc thực tập.\r\n\"Chỉ thực tập sáng thứ 7\".',NULL,NULL,204,204,NULL,'2021-11-15 14:56:07','2021-11-15 14:58:26'),(169,86,'12/07/2021','18/07/2021','Công việc được giao:\r\n- Tìm hiểu và làm chức năng truy cập thư mục tệp tin của điện thoại và lưu đường dẫn của file đã chọn.\r\n\r\nNội dung – kết quả đạt được:\r\n- Mở được thư mục điện thoại, lấy đường dẫn file và lưu đường dẫn vào database.','Công việc được giao:\r\n- Tìm hiểu cách thức truyền file giữa điện thoại và máy tính thông qua: usb, Bluetooth, share folder.\r\n\r\nNội dung – kết quả đạt được:\r\n- Tìm hiểu được cách chuyển file giữa điện thoại android với nhau.\r\n- Chưa tìm được cách liên kết điện thoại với máy tính.','Công việc được giao:\r\n- Tìm hiểu cách thức chuyển file từ điện thoại sang máy tính qua đường USB và gửi dữ liệu vào thư mục được định sẵn trong máy tính.\r\n\r\nNội dung – kết quả đạt được:\r\n- Tìm hiểu được cách nhận biết khi điện thoại đang kết nối usb.\r\nChưa tìm được cách truy cập vào thư mục cần gửi qua máy tính thông qua cổng usb từ điện thoại.','Công việc được giao:\r\n- Tiếp tục tìm hiểu cách thức chuyển file từ điện thoại sang máy tính qua đường USB và gửi dữ liệu vào thư mục được định sẵn trong máy tính.\r\n\r\nNội dung – kết quả đạt được:\r\n- Chưa tìm được cách truy cập thư mục trong máy tính thông qua cổng usb trong điện thoại.','Công việc được giao:\r\n- Tìm hiểu cách thức chuyển file từ điện thoại sang máy tính thông qua Shared folder.\r\n\r\nNội dung – kết quả đạt được:\r\n- Chưa tìm được cách liên kết với Shared folder trên máy tính với điện thoại android.','Công việc được giao:\r\n- Tìm hiểu cách thức chuyển file từ điện thoại sang máy tính thông qua Bluetooth.\r\n\r\nNội dung – kết quả đạt được:\r\n- Chưa tìm được cách truy cập tới thư mục trên máy tính qua điện thoại android.',NULL,NULL,78,78,NULL,'2021-11-15 15:16:58','2021-11-15 15:16:58'),(170,86,'19/07/2021','25/07/2021','Công việc được giao:\r\n- Tìm hiểu và làm app scan Barcode/QR code\r\n- Xuất kết quả quét được dưới dạng Toast\r\n- Tạo navigation drawer để lưu những kết quả quét được\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã quét được QR code/Barcode, xuất kết quả ra Toast và lưu kết quả vào navigation drawer','Công việc được giao:\r\n- Tối ưu camera để ứng dụng quét kết quả nhanh hơn\r\n- Lập tài liệu ứng dụng\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Tối ưu camera bằng cách thu nhỏ vùng quét để điện thoại lấy nét tốt hơn và xuất kết quả nhanh hơn','Không có task','Công việc được giao:\r\nNghiên cứu ứng dụng quản lý danh sách hóa đơn và đặt đồ ăn, Ứng dụng gồm:\r\n- Danh sách cửa hàng\r\n- Hiển thị danh sách cửa hàng trên Map, show marker, đổi image marker (marker vị trí của tôi, marker cửa hàng)\r\n- Tính khoảng cách từ vị trí của mình đến cửa hàng, khi click vào 1 marker trên map > hiển thị khoảng cách\r\n- Tìm kiếm cửa hàng (theo tên, địa chỉ)\r\n- Sắp xếp danh sách cửa hàng gần vị trí của tôi\r\n- Xem thông tin chi tiết một cửa hàng\r\n- Xem danh sách món tại cửa hàng\r\n- Màn hình (đăng nhập, đăng ký, Profile)\r\n\r\nYêu cầu:\r\n- Làm trước: phân tích, vẽ flowchart các màn hình và phân tích database\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Thiết kế database của user','Công việc được giao:\r\n- Sửa database & vẽ flowchart\r\n\r\nNội dung – kết quả đạt được:\r\n- Thiết kế xong flowchart ứng dụng','Không có task mới',NULL,NULL,78,78,NULL,'2021-11-15 15:29:50','2021-11-15 15:29:50'),(171,86,'26/07/2021','01/08/2021','Không có task mới','Công việc được giao:\r\n- Tìm hiểu và làm phần Đăng nhập, Đăng ký cho ứng dụng\r\n- Kết nối firebase, làm authentication\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Hoàn thành chức năng đăng ký (authentication bằng email trên firebase), và đăng nhập vào màn hình home và lấy thông tin tài khoản','Công việc được giao:\r\n- Tìm hiểu google map, hiển thị thông tin trong trang account, thay đổi mật khẩu\r\n\r\nNội dung – kết quả đạt được:\r\n- Google map chỉ mới lấy được vị trí từ tọa độ cố định, chưa lấy được vị trí hiện tại.\r\n- Hoàn thành được chức năng thay đổi mật khẩu của user','Công việc được giao:\r\n- Tiếp tục tìm hiểu google map.\r\n- Cập nhật thông tin tài khoản user.\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Lấy được vị trí hiện tại trên google map.\r\n- Cập nhật được thông tin user và lưu hình ảnh user lên firebase storage.','Công việc được giao:\r\n- Xuất danh sách sản phẩm.\r\n- Lưu sản phẩm yêu thích và hiện danh sách các sản phẩm đã lưu\r\n\r\nNội dung – kết quả đạt được:\r\n- Hiện danh sách 2 mục sản phẩm (Cà phê đóng gói & Gift Set combo), có chức năng lưu sản phẩm yêu thích và  hiện danh sách các sản phẩm đã lưu.','Công việc được giao:\r\n- Tim hiêu về bảo mật(rules) của firebase realtime database\r\n\r\nNội dung – kết quả đạt được:\r\n- Hiểu được cách câp nhật lại rules cho user: email và số điện thoại để không được trùng nhau',NULL,NULL,78,78,NULL,'2021-11-15 15:33:52','2021-11-15 15:33:52'),(172,86,'02/08/2021','08/08/2021','Công việc được giao:\r\n- Cập nhật các rules cho firebase realtime database\r\n- Làm tiếp phần cart icon trên menu bar.\r\n- Hiển thị chi tiết thông tin sản phẩm, thêm sản phâm vào giỏ hàng\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Cập nhật rules cho user, user chỉ đọc hoặc ghi được khi $uid được xác mình bởi authentiocation, email & phone không được trùng với các user khác.\r\n- Lấy được số lượng sản phẩm trong giỏ hàng, hiển thị chi tiết thông tin sản phẩm và thêm sản phẩm vào giỏ hàng.','Công việc được giao:\r\n- Xem chi tiết các sản phẩm trong giỏ hàng, thay đổi số lượng hoặc xóa sản phẩm khỏi giỏ hàng\r\n\r\nNội dung – kết quả đạt được:\r\n- Làm được các chức năng xem chi tiết các sản phẩm trong giỏ hàng, thay đổi số lượng hoặc xóa sản phẩm khỏi giỏ hàng','Công việc được giao:\r\n- Tìm hiểu và làm lấy vị trí cửa hàng gần nhất và tìm kiếm cửa hàng theo địa chỉ\r\n\r\nNội dung – kết quả đạt được:\r\n- Lấy được danh sách các cửa hàng có vị trì từ gấn nhất tới xa nhất, tìm kiếm cửa hàng theo địa chỉ nhập vô.','Công việc được giao:\r\n- Tim hiểu route draw từ vị trí hiện tại đến vị trí cần đến trong google map\r\n\r\nNội dung – kết quả đạt được:\r\n- Làm được chức năng vẽ route trên bằng cách sử dụng google map API','Công việc được giao:\r\n- Tìm hiểu cách vẽ route trên google map không sử dụng google map api\r\n\r\nNội dung – kết quả đạt được:\r\n- Không tìm được cách tự vẽ route trên google map nên đổi cách xử lí sang chuyển dữ liệu vị trí qua cho google map định hướng','Không có task mới',NULL,NULL,78,78,NULL,'2021-11-15 15:36:39','2021-11-15 15:36:39'),(173,86,'09/08/2021','15/08/2021','Công việc được giao:\r\n- Xem chi tiết cửa hàng: tên cửa hàng, vị trí, rating,…\r\n- Tạo đơn hàng cho user\r\n\r\nNội dung – kết quả đạt được:\r\n- Làm được chức năng xem chi tiết cửa hàng: tên cửa hàng, vị trí, rating,…, chức năng gọi cho cửa hàng, tạo đơn hàng cho user','Công việc được giao:\r\n- Tim hiểu và làm nhân viên để xử lí đơn hàng	\r\n- Khi nhân viên duyệt sẽ tự động mở app grab, be hay gì đó để ship\r\n- Với form book chuyển phát từ a đến b và danh sách đơn hàng trong phần nội dung chuyển phát\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Hoàn thành chức năng tạo đơn hàng mới.\r\n- Tạo 1 app mới và làm chức năng đăng nhập cho nhân viên','Công việc được giao:\r\n- Làm chức năng hiện danh sách các đơn hàng đã đặt.\r\n- Lọc các đơn đặt trong: 30 ngày, 90 ngày, 1 năm\r\n\r\nNội dung – kết quả đạt được:\r\n- Hoàn thành chức năng hiện danh sách các đơn hàng đã đặt.\r\n- Hoàn thành chức năng lọc các đơn đặt trong: 30 ngày, 90 ngày, 1 năm.','Công việc được giao:\r\n- Xem chi tiết đơn hàng và thanh hiển thị tình trạng đơn hàng.\r\n- Chức năng hủy đơn hàng cho user\r\n\r\nNội dung – kết quả đạt được:\r\n- Hoàn thành chức năng hiển thị chi tiết đơn hàng (đơn nhận tại cửa hàng, đơn giao tận nơi) và nút hủy đơn hàng chỉ hủy được khi chưa xác nhận đơn hàng.','Công việc được giao:\r\n- Làm các chức năng cơ bản cho bên nhân viên (thay hình ảnh đại diện, đổi thông tin cá nhân, đổi mật khẩu)	\r\n- Cập nhật số lượng đơn hàng mới, đơn đang xử lí, đơn nhận tại cửa hàng và đơn bị hủy bởi user.\r\n\r\nNội dung – kết quả đạt được:\r\n- Làm xong các chức năng cơ bản cho bên nhân viên (thay hình ảnh đại diện, đổi thông tin cá nhân, đổi mật khẩu)\r\n- Hoàn thành cập nhật số lượng đơn hàng mới, đơn đang xử lí, đơn nhận tại cửa hàng và đơn bị hủy bởi user.','Không có task mới',NULL,NULL,78,78,NULL,'2021-11-15 15:41:02','2021-11-15 15:41:02'),(174,86,'16/08/2021','22/08/2021','Công việc được giao:\r\n- Tìm hiểu và làm chức năng nhận biết khi người dùng đang online hay offline.\r\n\r\nNội dung – kết quả đạt được:\r\n- Làm được chức năng xuất danh sách tất cả user và hiển thị trạng thái của user.','Công việc được giao:\r\n- Làm lại chức năng tạo đơn hàng cho user. Thiết kế lại database để nhân viên ở các cửa hàng khác nhau có thể xử lí đơn hàng mà không bị conflict\r\n\r\nNội dung – kết quả đạt được:\r\nCách xử lí:\r\n- Khi đặt đơn hàng sẽ tự động gửi order về cho store gần vị trí user nhất.\r\n- Chỉ có nhân viên làm việc tại cửa hàng đó mới có thể tiếp nhận và xử lí đơn hàng.','Công việc được giao:\r\n- Xem chi tiết và xử lí đơn hàng khi nhận tại shop cho nhân viên.\r\n\r\nNội dung – kết quả đạt được:\r\n- Hoàn thành chức năng xem chi tiết order của user và có thể xác nhận hoặc hủy đơn hàng.\r\n- Sau khi xác nhận sẽ đưa đơn hàng vào trạng thái đang xử lí tùy theo loại đơn hàng hoặc hủy đơn khi xác nhận thất bại và đưa vào thống kê.','Xin nghỉ đi tiêm vaccine Verocell','Công việc được giao:\r\n- Tìm hiểu làm việc với ứng dụng bên grab.\r\n- Tìm hiểu Google Cardboard for Android NDK.\r\n\r\nNội dung – kết quả đạt được:\r\n- Chưa tìm dc cách liên kết app với grab, chỉ tìm được 1 thư viện grab partner trên github hỗ trợ mình đăng nhập grabID trên ứng dụng nhưng cần lấy credential thông qua grabID team','Không có task mới',NULL,NULL,78,78,NULL,'2021-11-15 15:45:53','2021-11-15 15:45:53'),(175,86,'23/08/2021','29/08/2021','Công việc được giao:\r\n- Tìm hiểu làm ứng dụng cho shipper nội bộ.\r\n\r\nNội dung – kết quả đạt được:\r\nPhân tích chức năng: \r\n-	Sau khi nhân viên xác nhận đơn hàng thành công sẽ giao đơn cho shipper.\r\n-	Shipper sẽ vào xác nhận đơn hàng cần giao.\r\n-	Shipper tiến hành giao đơn và cập nhật tình trạng đơn hàng ki giao hàng thành công hay thất bại.','Công việc được giao:\r\n- Thiết kế thêm về phần database cho shipper.\r\n- Làm trang home cho ứng dụng, chức năng login,…\r\n\r\nNội dung – kết quả đạt được:\r\n- Làm xong chức năng đăng nhập cho shipper.\r\n- Gặp khó khăn khi thiết kế data order. Chưa thiết kế được cách tạo order có nhiều điểm đến.','Công việc được giao:\r\n- Thiết kế được data cho order cho shipper.\r\n\r\nNội dung – kết quả đạt được:\r\n- 1 order của shipper gồm có: thông tin shipper phụ trách, vị trí lấy hàng tại cửa hàng, danh sách các đơn hàng cần giao (mỗi đơn hàng sẽ giao tới cho user)','Công việc được giao:\r\n- Tạo yêu cầu ship cho nhân viên sau khi xác nhận đơn cần giao\r\n- Lấy danh sách các đơn hàng cho shipper\r\n\r\nNội dung – kết quả đạt được:\r\n- Sau khi nhân viên xác nhận đơn hàng thành công sẽ tự động gửi yêu cầu ship tới cho shipper.	\r\n- Shipper đăng nhập sẽ lấy danh sách các đơn yêu cầu và tiến hành thao tác đơn hàng.','Công việc được giao:\r\n- Làm chức năng tracking tình trạng đơn hàng\r\n\r\nNội dung – kết quả đạt được:\r\n- Làm được chức năng tracking tình trạng đơn hàng bằng timeline.','Không có task mới',NULL,NULL,78,78,NULL,'2021-11-15 15:51:21','2021-11-15 15:51:21'),(176,86,'30/08/2021','05/09/2021','Công việc được giao:\r\n- Làm chức năng hiển thị chi tiết đơn hàng, lấy danh sách các đơn đang giao\r\n\r\nNội dung – kết quả đạt được:\r\n- Làm xong chức năng hiển thị chi tiết đơn hàng, lấy danh sách các đơn đang giao khi shipper đồng ý nhận đơn','Công việc được giao:\r\n- Tìm hiểu sử dụng về các API khác ngoài realtime: weather API\r\n- Tìm hiểu cách upload project lên git\r\n\r\nNội dung – kết quả đạt được:\r\n- Đang tìm hiểu cách sử dụng API thời tiết trên openweathermap','Công việc được giao:\r\n- Tìm hiểu cách lấy dữ liệu thời tiết từ vị trí GPS\r\n\r\nNội dung – kết quả đạt được:\r\n- Lấy được dữ liệu thời tiết từ vị trí GPS và hiển thị lên màn hình','Nghỉ lễ 02/09/2021','Công việc được giao:\r\n- Tìm hiểu và làm FireStore của Firebase.\r\n- Cách thức lưu dữ liệu lên và lấy dữ liệu xuống từ FireStore\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã lưu được dữ lên và lấy dữ liệu xuống từ FireStore','Không có task',NULL,NULL,78,78,NULL,'2021-11-15 15:53:48','2021-11-15 15:53:48'),(177,86,'06/09/2021','12/09/2021','Công việc được giao:\r\n- Tìm hiểu cách tính tỉ lệ KH mua hàng và KH không mua hàng trên realtime database.\r\n- Tìm hiểu kỹ rules của các database sao cho user A nào đó không thể can thiệp được data của user B.\r\n\r\nNội dung – kết quả đạt được:\r\n- Tìm hiểu cách để sửa rules cho firebase, ở rules hiện tại thì mỗi user chỉ được chỉnh sửa thông tin tài khoản của mình nhưng đọc được thông tin của user khác, sửa lại: \r\n \r\n- Mỗi user chỉ được phép đọc hoặc ghi thông tin của chính tài khoản mình nhưng cả admin cũng không can thiệp được thông tin của user.\r\n \r\n- Cập nhật thêm: sau khi được anh Long hướng dẫn đã biết cách set rules để admin có thể đọc được data của user','Công việc được giao:\r\n- Làm chức năng tiếp nhận đơn hàng cho shipper và tạo giao diện xử lí đơn hàng\r\n\r\nNội dung – kết quả đạt được:\r\n- Làm chức năng tiếp nhận đơn hàng cho shipper và tạo giao diện xử lí đơn hàng','Công việc được giao:\r\n- Làm chức năng xử lí đơn hàng cho shipper.\r\n- Cập nhật ti lệ mua hàng của user.\r\n\r\nNội dung – kết quả đạt được:\r\n- Hoàn thành chức năng xử lí đơn hàng cho shipper. Sau khi shipper giao xong đơn sẽ cập nhật tỉ lệ mua hàng của user và hiển thị trong danh sách user.','Công việc được giao:\r\n- Làm chức năng hiển thị trạng thái cửa hàng trên bản đồ khi user đặt order.\r\n\r\nNội dung – kết quả đạt được:\r\n- Hiển thị thông báo và hiệu ứng cho marker vị trí của cửa hàng khi user đặt order ở cửa hàng đó.','Hoàn thiện báo cáo từ tuần 1 đến nay và nộp giáo viên hướng dẫn.','Không có task',NULL,NULL,78,78,NULL,'2021-11-15 15:57:04','2021-11-15 15:57:04'),(178,86,'13/09/2021','19/09/2021','Công việc được giao:\r\n- Lấy danh sách lịch sử giao dịch các đơn đã giao của shipper\r\n- Thống kê doanh thu của shipper\r\n\r\nNội dung – kết quả đạt được:\r\n- Lấy được danh sách các đơn đã giao của shipper. \r\n- Thống kê doanh thu của ngày hiện tại và ngày trước đó.','Công việc được giao:\r\n- Tìm hiểu cách lấy dữ liệu địa chỉ từ google API.\r\n\r\nNội dung – kết quả đạt được:\r\n- Lấy được danh sách địa chỉ từ google api và cập nhật địa chỉ giao hàng cho user.','Công việc được giao:\r\n- Làm chức năng tạo thêm địa chỉ khác cho user\r\n\r\nNội dung – kết quả đạt được:\r\n- Làm được chức năng thêm xóa sửa và xuất danh sách các địa chỉ cho user.','Công việc được giao:\r\n- Thêm cái danh sách địa chỉ đã lưu trong chức năng sửa địa chỉ khi đặt hàng.\r\n- Tìm hiểu chức năng thống kê đơn hàng cho nhân viên.\r\n\r\nNội dung – kết quả đạt được:\r\n- Làm được chức năng thêm danh sách các địa chỉ đã lưu trong chức năng chỉnh sửa địa chỉ, chọn địa chỉ và cập nhật.','Xin nghỉ tiêm mũi 2 vaccine Verocell','Không có task',NULL,NULL,78,78,NULL,'2021-11-15 16:00:29','2021-11-15 16:00:29'),(179,104,'19/7/2021','23/7/2021','YÊU CẦU: \r\n    -Cài đặt wampserver và laravel, nghiên cứu tool postman\r\n    -Cài đặt thư viện Auth: Login, logout, register\r\n    -Viết hàm chức năng thêm, xoá, sửa dữ liệu cho người dùng đã đăng nhập\r\nTIẾN ĐỘ LÀM VIỆC:\r\n     - Cài đặt thành công wampserver và laravel, tìm hiểu được cách sử dụng postman\r\n     - Cài thành công thư viện Auth\r\n     - Viết được các chức năng login, logout, register và các hàm thêm, xoá, sử cho table protype','YÊU CẦU: \r\n    -Tạo api cho user login, register\r\n    -Tạo api thêm, xóa, sửa table protype và phải xác thực token trước khi thực thực hiện\r\n\r\nTIẾN ĐỘ LÀM VIỆC:\r\n    - Viết được các hàm tạo api cho user login, logout, regiter và dùng postman để test hàm\r\n    - Tạo thành công api xem tất cả protype, thêm, xóa, sửa protype','YÊU CẦU: \r\n    -Tìm hiểu về graphql cho laravel\r\nTIẾN ĐỘ LÀM VIỆC:\r\n   -Cài đặt thành công graphql\r\n   -Viết các query cho user','YÊU CẦU: \r\n    -Graphql:\r\n      +Code phần login, register\r\n      +Xác thực token\r\n      + Code phần insert, update, delete\r\nTIẾN ĐỘ LÀM VIỆC:\r\n   -Viết được các hàm thực hiện chức năng login và register (Type, Query)\r\n   -Viết được hàm insert, update, delete cho protype và buộc người dùng phải xác thực token trước','YÊU CẦU: \r\n    -Test các query trên Qraphiql\r\n    -Code phần schema\r\nTIẾN ĐỘ LÀM VIỆC:\r\n   -Cài đặt lighthouse\r\n   -Test thành công các query\r\n   -Viết được các type, query và mutation trong file schema.graphql',NULL,NULL,NULL,303,303,NULL,'2021-11-15 16:02:49','2021-11-15 16:02:49'),(180,86,'20/09/2021','26/09/2021','Công việc được giao:\r\n- Làm chức năng thống kê cho nhân viên:\r\n+ Thống kê đơn hàng: hiển thị đơn hàng theo tháng đã chọn\r\n+ Thống kê cửa hàng: hiển thị doanh thu của cửa hàng theo tháng đã chọn\r\n\r\nNội dung – kết quả đạt được:\r\n+ Làm được chức năng thống kê các đơn hàng từ tháng đã chọn đến hiện tại\r\n+ Làm được chức năng tính doanh thu của các đơn hàng thành công cho từng cửa hàng theo từ tháng đã chọn đến tại.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,78,78,NULL,'2021-11-15 16:03:31','2021-11-15 16:03:31'),(181,104,'26/7/2021','31/7/2021','Làm quen và trao đổi công việc với anh Huy','YÊU CẦU:\r\n   - Sửa lại UI website cho hợp với yêu cầu dự án\r\nTIẾN ĐỘ LÀM VIỆC:\r\n  - Chỉnh sửa hình ảnh, chuyển động của logo\r\n  -Sửa content của phần header, about IMT, team và token sale','YÊU CẦU:\r\n   -Tiếp tục chỉnh sửa UI\r\n   -Chuyển đổi ngôn ngữ hiện tại sang: Japan, Vietnamese, Chinese\r\nTIẾN ĐỘ LÀM VIỆC:\r\n -Chỉnh lại UI phần roadmap, sửa lại kích thước các tấm ảnh phần team cho hợp với giao diện\r\n -Tích hợp được bộ chuyển đổi ngôn ngữ từ google translate','YÊU CẦU:\r\n   - Chỉnh lại khoảng cách giữa các phần, cập nhật ảnh và content cho hợp với dự án, thiết kế biểu đồ chia theo tỉ lệ yêu cầu\r\n   - Chỉnh UI trên mobile\r\nTIẾN ĐỘ LÀM VIỆC:\r\n -Thiết lập khoảng cách giữa các phần gần hơn\r\n -Chỉnh lại ảnh phần whitepaper, nội dung phần token sale và token distribution\r\n -Dùng thư viện am4core để tạo biểu đồ\r\n -Chỉnh sửa UI cho phù hợp trên mobile','YÊU CẦU:\r\n   -Viết content cho phần FAQ\r\n   -Tích hợp với database bên back-end\r\nTIẾN ĐỘ LÀM VIỆC:\r\n   -Hoàn thành content phần FAQ\r\n   -Dùng laravel triển khai database',NULL,NULL,NULL,303,303,NULL,'2021-11-15 16:10:30','2021-11-15 16:10:30'),(182,104,'2/8/2021','7/8/2021','YÊU CẦU:\r\n-Cập nhật một số thay đổi của UI dự án\r\nTIẾN ĐỘ LÀM VIỆC:\r\n-Chỉnh sửa hoàn tất UI của dự án: fix lại một