ng.\r\nNội dung đã thực hiện: Hoàn thành phát thảo lần 1.',NULL,NULL,222,222,NULL,'2021-11-15 19:36:19','2021-11-15 19:48:12'),(219,116,'19/07/2021','24/07/2021','Công việc được giao: Sửa lại bản thiết kế\r\nNội dung đã thực hiện: Nhận lại bản thiết kế , sửa lại bản thiết kế.','Công việc được giao: Tìm hiểu ngôn ngữ React Native.\r\nNội dung đã thực hiện: Đọc tài liệu về ngôn ngữ React Native.','Công việc được giao: Tìm hiểu về Navigation.\r\nNội dung đã thực hiện: Đọc tài liệu về Navigation Stack.','Công việc được giao: Thiết kế và thêm màn hình Splash Screen vào ứng dụng.\r\nNội dung đã thực hiện: Hoàn thành chức năng màn hình Splash Screen.','Công việc được giao: Tìm hiểu về FlatList và SwipeOut , làm màn hình Home Screen \r\nNội dung đã thực hiện: Đọc tài liệu về FlastList và SwipeOut, làm màn hình Home Screen.','Công việc được giao: Thêm dữ liệu vào FlatList\r\nNội dung đã thực hiện: Hoàn thành thêm dữ liệu vào FlatList.',NULL,NULL,222,222,NULL,'2021-11-15 19:37:06','2021-11-15 19:55:57'),(220,116,'26/07/2021','31/07/2021','Công việc được giao: Hoàn thành màn hình Add Screen.\r\nNội dung đã thực hiện: Thiết kế giao diện màn hình Add Screen giống với thiết kế.','Công việc được giao: Hoàn thành màn hình Add Screen.\r\nNội dung đã thực hiện: Thiết kế giao diện màn hình Add Screen giống với thiết kế( TextInput).','Công việc được giao: Hoàn thành màn hình Add Screen.\r\nNội dung đã thực hiện: Thiết kế giao diện màn hình Add Screen giống với thiết kế ( DatePicker chọn ngày tháng năm, DropDownPicker chọn thời gian bảo hành ).','Công việc được giao: Hoàn thành màn hình Add Screen.\r\nNội dung đã thực hiện: Tìm hiểu về ImagePicker, Làm chọn ảnh và chụp ảnh để lưu lại (30%)','Công việc được giao: Hoàn thành màn hình Add Screen.\r\nNội dung đã thực hiện: Tìm hiểu về ImagePicker, Làm chọn ảnh và chụp ảnh để lưu lại (70%)','Công việc được giao: Hoàn thành màn hình Add Screen.\r\nNội dung đã thực hiện: Tìm hiểu về ImagePicker, Làm chọn ảnh và chụp ảnh để lưu lại(100%), Tìm k