ind car\r\n-Thiết kế trang detail car','YÊU CẦU:\r\n-Triển khai tiếp các trang UI của dự án\r\nTIẾN ĐỘ LÀM VIỆC:\r\n-Tiếp tục thiết kế, chỉnh sửa phần filter\r\n-Chỉnh sửa lại trang detail car','YÊU CẦU:\r\n-Triển khai tiếp các trang UI của dự án\r\nTIẾN ĐỘ LÀM VIỆC:\r\n-Làm thêm phần báo chí và các bên liên quan cho dự án\r\n-Suy nghĩ, thiết kế bố cục trang payment\r\n-Tìm hiểu thêm về UI các trang login, register, forget password, payment, profile',NULL,NULL,303,303,NULL,'2021-11-17 09:12:30','2021-11-17 09:12:30'),(279,152,'17/8/2021','22/8/2021','Nhận yêu cầu làm việc của công ty :Thiết kế bộ nhận diện thương hiệu cho cty chuyên nuôi và chế biến yến sào Sáu Quan\r\nlên ý tưởng\r\nĐọc tài liệu công ty giao','Nhận yêu cầu làm việc của công ty :Thiết kế bộ nhận diện thương hiệu cho cty chuyên nuôi và chế biến yến sào Sáu Quan.\r\nHoàn thành bản thiết kế logo','Nhận yêu cầu làm việc của công ty :Thiết kế bộ nhận diện thương hiệu cho cty chuyên nuôi và chế biến yến sào Sáu Quan.\r\nHoàn thành hướng dẫn sử dụng logo','Nhận yêu cầu làm việc của công ty :Thiết kế Banner dán lên hộp đèn đứng kích thước 60cm x 120cm.\r\nđọc tài liệu công ty giao\r\nLên ý tưởng và hoàn thành công việc','Nhận yêu cầu làm việc của công ty : Thiết kế Bảng hiệu kích thước 60cm x 300cm. (thiết kế và đính kèm tư vấn in trên chất liệu gì).\r\nLên ý tưởng và hoàn thành công việc',NULL,NULL,NULL,249,249,NULL,'2021-11-17 09:13:03','2021-11-17 09:15:01'),(280,104,'23/8/2021','28/8/2021','YÊU CẦU:\r\n-Nghiên cứu, tiếp tục thiết kế các trang còn thiếu của dự án\r\nTIẾN ĐỘ LÀM VIỆC:\r\n-Chỉnh sửa, thiết kế lại UI trang choose time, cùng bạn bên figma hoàn thiện thiết kế','YÊU CẦU:\r\n-Trao đổi với anh Dự để triển khai tiếp UI và logo cho dự án\r\nTIẾN ĐỘ LÀM VIỆC:\r\n-Thiết kế trang payment\r\n-Thiết kế trang hóa đơn\r\n-Trao đổi với bạn bên figma để đổi lại màu các button, background,...','YÊU CẦU:\r\n-Cùng anh Dự thiết kế tổng quan, thống nhất lại các UI của dự án trên figma\r\n-Dựa vào cập nhật trên 