iao )','Vẽ lại logo và dàn vào thiết kế hộp mà cô đã giao \r\nNhận xét: Nộp bài cô đã giao (chưa hoàn chỉnh vì vẫn con sai trong thiết kế lại logo , chưa đúng font chữ, nét chữ )','Vẽ lại logo giống mẫu\r\nThiết kế hộp bao bì  kích thước: 100x135x65mm\r\nNhận xét: Nộp 2 bài cho cô sau khi đã sửa lại hoàn chỉnh (sẩn phẩm logo là vẽ lại nên phải giống với mẫu đã đưa ra )','Thiết kế nhãn dán hạt maca \r\nkích thước nhãn: 80x100 mm\r\nNhận xét: Nộp bài nhãn dãn (chưa giống với mẫu ,xem lại màu sắc font chữ, chính tả)','Thiết kế nhãn dán hạt maca \r\nkích thước nhãn: 80x100 mm\r\nNhận xét: Nộp bài nhãn dãn và hộp đã dàn logo .',NULL,NULL,386,386,NULL,'2021-11-17 13:50:35','2021-11-17 13:50:35'),(320,162,'23/8/2021','29/8/2021',NULL,NULL,NULL,NULL,'Thiết kế tờ rơi kích thước A5 theo nội dung cô cho \r\nNhận xét: còn chưa hoàn chỉnh','Thiết kế tờ rơi kích thước A5 theo nội dung cô cho \r\nNhận xét: Nộp bài tờ rơi cho cô',NULL,NULL,386,386,NULL,'2021-11-17 13:52:21','2021-11-17 13:52:21'),(321,162,'30/8/2021','5/9/2021',NULL,NULL,NULL,NULL,'Thiết kế lại nhãn dán \r\nThiết kế lại hộp théo kích thước \r\nThiết kế voucher \r\nNhận xét: Đã nộp bài nhưng còn thiếu','Thiết kế lại nhãn dán \r\nThiết kế lại hộp théo kích thước \r\nThiết kế voucher \r\nNhận xét: Đã nộp bài nhưng còn thiếu',NULL,NULL,386,386,NULL,'2021-11-17 13:53:37','2021-11-17 13:53:37'),(322,162,'6/9/2021','12/9/2021','Thiết kế lại nhãn dán \r\nThiết kế lại hộp théo kích thước \r\nThiết kế voucher \r\nNhận xét: Đã nộp bài nhưng còn thiếu','Thiết kế lại nhãn dán \r\nThiết kế lại hộp théo kích thước \r\nThiết kế voucher \r\nNhận xét: Nộp bài nhưng chưa giống mẫu','Thiết kế lại nhãn dán \r\nThiết kế lại hộp théo kích thước \r\nThiết kế voucher \r\nNhận xét: Nộp bài hoàn chỉnh',NULL,NULL,NULL,NULL,NULL,386,386,NULL,'2021-11-17 13:55:38','2021-11-17 13:55:38'),(326,162,'13/9/2021','19/9/2021',NULL,NULL,'1.Thiết kế name card nhà hàng nàng gánh\r\n2. Thiết kế  post card – cảm ơn cho nhà hàng\r\n3. Thiết kế nhãn Dầu thuố