thực tập và ngày kết thúc báo cáo đề tài.','Tìm hiểu về VOIP: Tìm hiểu khái niệm, phương thức hoạt động và ưu nhược điểm VoIP.','Tìm hiểu về các giao thức phổ biến trong VOIP\r\nVOIP sử dụng 2 giao thức phổ biến là H323 và SIP. Trong đó SIP được dùng phổ biến nhất.','Xây dựng triển khai mô hình trên word.\r\nĐịnh hướng được mô hình cần triển khai: \r\n    + 1 máy ảo FUSIONPBX đại diện cho Doanh nghiệp.\r\n    + 1 máy ảo ASTPP tính cước.','Định hướng phát triển theo mô hình đã xây dựng:\r\n    + Trong FUSIONPBX cần tạo các extension và đấu nối với ASTPP \r\n    + ASTPP đấu nối với telco (Doanh nghiệp Tel4vn) để extensions gọi được ra ngoài.','Tổng hợp các nội dung và update vào word.',NULL,NULL,409,409,NULL,'2021-11-17 16:19:19','2021-11-17 16:19:19'),(337,161,'2/8/2021','7/8/2021','Tìm hiểu về khái niệm, cấu trúc, đặc điểm của Freeswitch','Tìm hiểu một số tính năng cơ bản có trong Freeswitch','Tìm hiểu về khái niệm, kiến trúc và cách cấu hình Fusionpbx','Tìm hiểu chi tiết về các tính năng có thể sử dụng  trong Fusionpbx: Call Center, Call Block,...','Tìm hiểu về khái niệm, cách thức hoạt động và cách cấu hình ASTPP	.','Các dịch vu, gói cước, tính năng trong ASTPP: Đặt đơn giá, gói cước trả trước, trả sau, nhóm hóa đơn.\r\nTổng hợp các nội dung vào file word.',NULL,NULL,409,409,NULL,'2021-11-17 16:23:12','2021-11-17 16:23:12'),(338,161,'9/8/2021','14/8/2021','Tìm hiểu cách cài đặt Fusionpbx, command cần có. Có 2 cách:\r\n   + cài từng gói\r\n   + cài tự động từ web https://fusionpbx.com/download (công ty cung cấp tài liệu tìm hiểu).\r\nTìm hiểu các lỗi thường gặp khi cấu hình và cách khắc phục.','Tiến hành cài đặt Fusionpbx theo cách cài từng gói.','Cài đặt Fusionpbx: theo cách cài tự động từ web','Tìm hiểu cách cài đặt ASTPP, các lỗi thường gặp và cách khắc phục.\r\nCó 2 cách cài là:cài từng gói và cài tự độg từ web https://docs.astppbilling.org/display/itplmars/v4.0','Tiến hành cài đặt ASTPP , cài đặt ASTPP theo từng gói','Tổng hợp các nội dung vào file word.',NULL