,167,'13/09/2021','19/09/2021','- Công việc được giao:\r\n   +Họp online nhận xét sản phẩm tuần trước(06/09/2021 - 12/09/2021)\r\n- Nội dung – kết quả đạt được:\r\n   + Nộp 1 sản phẩm\r\n- Nhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\n   +Hoàn thành đúng tiến độ\r\n   +Sản phẩm đạt yêu cầu\r\n   +Sinh viên có trách nhiệm trong công việc, thaais đọ cầu thị khi được gớp ý\r\n   +Thiết kế tốt, có phong cách riêng, mầu sắc sinh động, bố cục tương đối\r\n   +Có thể sử dụng sản phẩm tuyên truyền.','Chưa có công việc được giao','Chưa có công việc được giao','Chưa có công việc được giao','Chưa có công việc được giao','- Công việc được giao:\r\n   +Tạo 2 sản phẩm inforgraphic để tham gia cuộc thi thiết kế sản phẩm truyền thông”60 năm-huyền thoại đường Hồ Chí Minh trên biển”\r\n- Nội dung – kết quả đạt được:\r\n   + Sản phẩm phải có tiêu đề, chủ đề. Định dạng bằng file JPG hay PNG\r\n   + Hạn nộp: trước 20h  ngày 22/09/2021',NULL,NULL,387,387,NULL,'2021-11-17 20:10:09','2021-11-17 20:10:37'),(366,172,'26/07/2021','31/07/2021','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\n•	Định huớng phong cách thiết kế cho quán cà phê:\r\n	Tham khảo các thể loại quán cà phê trên internet (khá đa dạng, đây là điểm tiện lợi nhưng cũng là thử thách, vì quá đa dạng nên cần tìm hiểu kỹ để nắm được cốt lõi mới thể hiện được tốt cái “hồn” của phong cách đó)\r\n	Chốt lại phong cách thiết kế cuối cùng: hiện đại, đơn giản\r\n•	Tìm ý tưởng và chất liệu dùng trong thiết kế quán:\r\n	Đặt tên quán phù hợp: Passio Coffee\r\n	Tìm các chất liệu ốp tường, sàn, các mẫu texture để dùng cho các đồ dùng,…(tạm đủ cho nhu cầu phác thảo cơ bản bố cục, khi trang trí chuyên sâu hơn lúc gần hoàn thiện có thể tìm thêm)\r\nGhi chú: \r\nPhong cách tự chọn nhưng phải làm nổi bật đặc điểm đặc trưng của phong cách đó, đúng theo quy luật bố cục thiết kế nội thất, ngoại thất (ưu tiên các kiểu hình thiết kế mới, sáng tạo, độc đáo).','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\n•	Vẽ phác thảo và dựng bố cục cơ bản: tường, sàn nhà, bảng hiệu và áp chất liệu\r\n•	Thiết kế bảng hiệu:\r\n	Thiết kế logo bằng Illustrator rồi import sang 3ds max\r\n	Hoàn thành các yếu tố còn lại của bảng hiệu','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nTiến hành vẽ các đồ dùng đơn giản như bàn ghế, quầy pha chế,… và áp chất liệu','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nSắp xếp bố cục, vị trí đặt bàn ghế, quầy pha chế\r\nThông qua các mẫu tham khảo nội thất quán cà phê trên internet, xác định bố cục, vị trí đặt cửa chính, cửa sổ, vẽ chúng và áp chất liệu','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nTham khảo hướng dẫn trên youtube và vẽ bồn rửa, cốc cà phê, các kiểu ly thuỷ tinh','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nTham khảo trên hướng dẫn trên youtube và vẽ lò nướng, tủ lạnh',NULL,NULL,377,377,NULL,'2021-11-17 20:13:12','2021-11-17 20:13:12'),(367,172,'02/08/2021','07/08/2021','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m\r\n•	Vẽ tủ bếp và sắp xếp vị trí đặt tủ lạnh, bồn rửa, lò nướng, tủ bếp\r\n•	Sắp xếp vị trí ghế quầy pha chế và trang trí thêm cho quầy để tạo điểm nhấn với khách hàng','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\n•	Vẽ bồn rửa tay, toilet, các yếu tố chính của nhà vệ sinh và áp chất liệu\r\n•	Vẽ tivi, bộ dao bếp, thớt, áp chất liệu và sắp xếp vào vị trí hợp lý\r\n•	Vẽ máy pha cà phê, áp chất liệu và đặt lên quầy pha chế\r\n•	Vẽ quạt trần và áp chất liệu','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\n•	Vẽ các kệ ly, tách, dĩa, muỗng,… để đựng ly, tách, dĩa, muỗng,…, áp chất liệu và xếp vào vị trí thích hợp\r\n•	Vẽ các chai siro, dung dịch pha chế, hộp đựng ống hút, áp chất liệu và xếp lên tủ bếp\r\n•	Vẽ khay đựng nước uống mang lên cho khách của nhân viên phục vụ','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\n•	Vẽ đèn trần trang trí, đèn treo, đèn tường và áp chất liệu\r\n•	Sắp xếp vị trí các đèn, quạt trần, thêm hiệu ứng ánh sáng phù hợp\r\n•	Thay đổi chất liệu hoa văn nền và tường để mức độ hiển thị phù hợp hơn với hiệu ứng ánh sáng\r\n•	Đặt camera và render các góc ảnh đẹp\r\n•	Hoàn thành bài thực hành và gửi cho người phụ trách chờ nhận xét','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nLắng nghe nhận xét từ người phụ trách để rút thêm kinh nghiệm.\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\nTrên ô cửa kính có thể thêm hoạ tiết, và trong có thể làm thêm những vách ngăn hoa văn cnc lên và nộp lại bản chỉnh sửa hạn chót vào thứ 6 tuần sau.','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\n•	Vẽ thêm vách ngăn cnc và áp chất liệu\r\n•	Đổi lại màu đèn treo\r\n•	Đổi lại hoạ tiết tường',NULL,NULL,377,377,NULL,'2021-11-17 20:27:24','2021-11-17 20:27:24'),(368,172,'09/08/2021','14/08/2021','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\n•	Vẽ chỉnh sửa lại quầy pha chế bo góc nhiều hơn để giảm độ thô cứng\r\n•	Thêm những hoạ tiết chữ, các icon nhỏ trên mặt kính cửa sổ mặt trước để tạo sự dễ thương, năng động\r\n•	Vẽ bảng menu ở quầy pha chế, các poster mini treo ở các góc tường nhằm truyền tải sự hấp dẫn của các sản phẩm đồ uống đến khách hàng, giải quyết khó khăn đối với các khách hàng khó lựa chọn món khi đến quán, giúp tạo ấn tượng đến khách hàng về thương hiệu một cách tự nhiên và hiệu quả.','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nRender các góc ảnh chi tiết (lần này render nhiều góc ảnh hơn, file nặng nên thời gian chờ máy render xong cũng mất thời gian hơn)','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nGửi bài cho người phụ trách thực tập để nghe nhận xét về bài đã chỉnh sửa','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nChờ nhận xét phản hồi từ phía người phụ trách thực tập','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nHạn cuối nộp bài chỉnh sửa thiết kế quán cà phê, tiếp tục chờ phản hồi từ phía người phụ trách','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nNgười phụ trách thực tập tổng hợp tiếp nhận bài nộp và tiếp tục chờ nhận xét phản hồi từ phía người phụ trách thực tập',NULL,NULL,377,377,NULL,'2021-11-17 20:34:22','2021-11-17 20:34:22'),(369,172,'16/08/2021','21/08/2021','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nChờ người phụ trách xem bài và nhận xét','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nNgười phụ trách đưa ra nhận xét và đề nghị chỉnh sửa lại hoàn thiện bài\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\nKết cấu bố cục tạm ổn nhưng có vẻ còn đơn giản, nên thiết kế thêm một tầng lầu nữa, hạn chót nộp bài vào thứ 3 tuần sau','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nVẽ thêm cầu thang, áp chất liệu và đục lỗ trần nhà','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\n•	Copy bàn ghế, sắp xếp theo bố cục\r\n•	Thêm nhà vệ sinh cho tầng trên\r\n•	Tăng chiều cao các cột xà nhà','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\n•	Vẽ tường bao quanh cho tầng trên\r\nThêm mặt kính để tạo cảm giác không gian rộng hơn, thoáng hơn\r\n•	Thêm vách ngăn cnc phía cầu thang đi lên để tạo cảm giác chắc chắn\r\n•	Thêm tivi để khách có thể xem giải trí\r\n•	Vẽ thêm kệ sách để phục vụ nhu cầu đọc của khách hàng, đồng thời trang trí thêm cho không gian','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nThêm đèn, quạt trần, đèn trang trí, mái che, hoàn thành bài chỉnh sửa',NULL,NULL,377,377,NULL,'2021-11-18 02:16:31','2021-11-18 02:16:31'),(370,172,'23/08/2021','28/08/2021','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nRender lại một số góc ảnh và gửi bài chỉnh sửa cho người phụ trách','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nNgười phụ trách tổng hợp nhận bài chỉnh sửa','Thiết kế quán cà phê bằng 3ds max kích thước mặt bằng 10x22m \r\nTất cả bài của thực tập sinh được thông qua, kết thúc đề án thiết kế quán cà phê','Thiết kế 4 poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang\r\n•	Người phụ trách giao việc, trao đổi yêu cầu về nội dung ý nghĩa của poster\r\n•	Tìm thêm tư liệu về logo, các sản phẩm, công dụng và tất cả các thông tin để hiểu rõ hơn về thương hiệu\r\n•	Lên ý tưởng ban đầu: poster 1 là poter tổng hợp các sản phẩm, 3 poster còn lại là poster của từng loại sản phẩm \r\nGhi chú:\r\nCác poster phải có sự thống nhất, liên kết về màu sắc, bố cục','Thiết kế 4 poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang\r\n•	Tham khảo một số poster trên internet để lọc ý tưởng\r\n•	Tách nền các sản phẩm bằng photoshop\r\n•	Tạo background poster, cho ảnh sản phẩm vào, tạo bóng đổ, trang trí bằng dải vector uốn lượn, đặt logo, hiệu ứng chiếu sáng, các thông tin text về khuyến mãi,….\r\n•	Hoàn thành poster 1','Thiết kế 4 poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang\r\n•	Xuất ảnh đã tách nền về sản phẩm dầu gội Thủ Đạo Thang\r\n•	Tách nền và xuất ảnh cô gái để minh hoạ cho sản phẩm\r\n•	Tạo background poster, các hiệu ứng trang trí, làm nổi bật, các thông tin về sản phẩm\r\n•	Hoàn thành poster 2',NULL,NULL,377,377,NULL,'2021-11-18 02:21:26','2021-11-18 02:21:26'),(371,172,'30/08/2021','04/09/2021','Thiết kế 4 poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang\r\n•	Xuất ảnh đã tách nền về sản phẩm dung dịch thanh lọc Thủ Đạo Thang\r\n•	Tách nền và ghép hình ảnh về chiết xuất nhân sâm, cây phỉ,…\r\n•	Tạo background poster, các hiệu ứng trang trí, làm nổi bật các thông tin về sản phẩm\r\n•	Hoàn thành poster 3','Thiết kế 4 poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang\r\n•	Xuất ảnh đã tách nền về sản phẩm tinh chất tơ tằm Thủ Đạo Thang\r\n•	Tìm kiếm hình ảnh và tách nền về chiết xuất tơ tằm tự nhiên\r\n•	Tạo background poster, các hiệu ứng trang trí, làm nổi bật các thông tin về sản phẩm\r\n•	Hoàn thành poster 4','Thiết kế 4 poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang\r\nXuất ảnh và file pdf 4 poster và gửi bài cho người phụ trách thực tập tổng hợp bài làm','Thiết kế 4 poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang\r\nNgười phụ trách đưa ra nhận xét về poster, các điểm cần chỉnh sửa\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\nMàu sắc phù hợp nhưng bố cục còn chưa chặt chẽ, còn khá đơn giản, vẫn thiếu sự bứt phá, nên dùng thêm các mảng, line trang trí thêm thay vì chỉ dùng đường nét uốn lượn. Hạn chót nộp bài chỉnh sửa là thứ 4 tuần sau','Thiết kế 4 poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang\r\n•	Thêm các hiệu ứng chiếu sáng để làm nổi bật bộ ba sản phẩm\r\n•	Thêm đường viền cho mảng khối để tạo sự cân bằng của bố cục\r\n•	Chỉnh lại hiệu ứng bóng đổ ngắn hơn để chân thực hơn\r\n•	Hoàn thành chỉnh sửa poster 1','Thiết kế 4 poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang\r\n•	Chỉnh lại màu của text, tạo khối bo góc đặt dưới nền dòng text “Thành phần”\r\n•	Tạo viền bo góc bao quanh phần text không hoá chất,… để đỡ có cảm giác lạc lõng, đổi màu text bảng giá\r\n•	Hoàn thành chỉnh sửa poster 2',NULL,NULL,377,377,NULL,'2021-11-18 02:25:48','2021-11-18 02:25:48'),(372,172,'06/09/2021','11/09/2021','Thiết kế 4 poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang\r\n•	Chỉnh lại màu của text, tạo khối bo góc đặt dưới nền dòng text “Thành phần”, “Cách sử dụng”\r\n•	Tạo viền bao ngắn góc phải và trái phần text các thành phần… để đỡ có cảm giác lạc lõng, đổi màu text bảng giá\r\n•	Tạo viền bo góc bao quanh phần text cách sử dụng sản phẩm\r\n•	Hoàn thành chỉnh sửa poster3','Thiết kế 4 poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang\r\n•	Chỉnh lại màu của text, tạo khối bo góc đặt dưới nền dòng text “Thành phần”, “Cách sử dụng”\r\n•	Tạo viền bao ngắn góc phải và trái phần text các thành phần… để đỡ có cảm giác lạc lõng, đổi màu text bảng giá\r\n•	Tạo viền bo góc bao quanh phần text cách sử dụng sản phẩm\r\n•	Hoàn thành chỉnh sửa poster 4','Thiết kế 4