,'2021-11-19 20:07:16'),(395,196,'02/08/2021','08/08/2021','*Công Việc được giao:\r\n  .Hỗ trợ thiết kế banner webinar cùng với team. \r\n*Nội dung – kết quả đạt được:\r\n  .Thiết kế Banner webinar “Đối diện tích cực với biến động mùa Covid – gặp gỡ BS: Nguyễn Trung Nghĩa”\r\n  .Đúng deadline\r\n  .Được chọn 1 option để làm thiết kế chính cho bài đăng.\r\n*Nhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\n  .Yêu cầu 3 option từ thực tập sinh\r\n  .Phải thể hiện được những yếu tố: Covid, Căng thẳng, Đối diện tích cực\r\n  .Thêm nội dung để thu hút tham gia: cách thức tham gia, sự kiện miễn phí, v.v.','*Công Việc được giao:\r\n  .Edit video \r\n*Nội dung – kết quả đạt được:\r\n  .Ghép bản dịch Tiếng Việt vào video “How to cope with the depression”\r\n  .Đúng deadline\r\n*Nhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\n  .Font dễ đọc, có dòng chữ “Dịch Tiếng Việt bởi Healthy Mind” \r\n  .Video video ổn chỉ cần điều chỉnh thêm về Font chữ.','*Công Việc được giao:\r\n  .Thiết kế templete “Quote Healthy Soul”\r\n*Nội dung – kết quả đạt được:\r\n  .Những câu trích dẫn hay, xoa dịu tinh thần.\r\n  .Đúng deadline\r\n  .làm được 6 option ( 3 ảnh vuông và 3 ảnh dọc) \r\n*Nhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\n  .Yêu cầu: Màu sắc: Sáng, tích cực, nhẹ nhàng, xoa dịu\r\n                  Bố cục: Đơn giản, dễ nhìn\r\n                  Nội dung: - Nội dung câu trích dẫn - Có dấu “” - Biểu trưng cho quotes\r\n                  Có tên tác giả\r\n                  Có khung đóng phần nội dung quotes (nếu cần thiết).\r\n  .Thiết kế đẹp, chỉnh chu một xíu về bố cục.','*Công Việc được giao:\r\n  .Tiếp tục thiết kế templete “Quote Healthy Soul” và  edit video đơn giản \r\n*Nội dung – kết quả đạt được:\r\n  .Ghép bản dịch Tiếng Việt vào video “Living with a black dog”\r\n  .Đúng deadline\r\n  .được chốt ngay lần gửi đầu video\r\n*Nhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\n  .Yêu cầu: Font dễ đọc, có dòng chữ “Dịch T