dia post Facebook\r\n\r\nNội dung - kết quả đạt được:\r\n- Hoàn thành 8 bài thiết kế\r\n\r\nNhận xét của người hướng dẫn:\r\n- Có những tiến bộ trong thiết kế, có tinh thần học hỏi và làm việc nhóm cao\r\n- Phát huy ý tưởng cá nhân tốt và phát huy được những điều đã học\r\n- Hoàn thành kịp deadline và nội dung được giao\r\n- Hỗ trợ tốt cho team và các bạn trong công ty','Công việc được giao:\r\n- Thiết kế Social media post Facebook\r\n- Chỉnh sửa thiết kế cũ trên Website\r\n- Tham gia chiến dịch minigame cho người dùng nhận voucher\r\n\r\nNội dung - kết quả đạt được:\r\n- Hoàn thành 13 bài thiết kế\r\n- Tìm hiểu, đọc nội dung yêu cầu thiết kế, họp và trao đổi với bộ phận content vê chiến dịch\r\n\r\nNhận xét của người hướng dẫn:\r\n- Chủ động cao trong công việc\r\n- Hoàn thành đúng tiến độ và biết lắng nghe để nâng cao chất lượng ấn phẩm\r\n- Có tinh thẩn học hỏi cao - làm đúng deadline\r\n- Có kiến thức về Typography, Sáng tạo trong thiết kế','Công việc được giao:\r\n- Thiết kế Social media post Facebook\r\n- Thiết kế lại ấn phẩm cũ trên Website\r\n\r\nNội dung - kết quả đạt được:\r\n- Hoàn thành 16 bài thiết kế\r\n- Tìm hiểu, đọc nội dung yêu cầu thiết kế, họp và trao đổi với bộ phận content vê chiến dịch\r\n- 1 bài sản phẩm chưa được đuyệt, chưa sáng tạo và nổi bật, trễ deadline\r\n\r\nNhận xét của người hướng dẫn:\r\n- Sáng tạo, hoàn thành đúng hạn\r\n- Làm đúng trọng tâm và có sáng tạo, đáng khen\r\n- Nắm được vấn đề điểm nhấn nhưng không thật sự sáng tạo. Cần một ít sáng tạo','Công việc được giao:\r\n- Thiết kế Social media post Facebook\r\n- Thiết kế lại ấn phẩm cũ trên Website\r\n\r\nNội dung - kết quả đạt được:\r\n- Hoàn thành 14 bài thiết kế\r\n\r\nNhận xét của người hướng dẫn:\r\n- Hoàn thành trước dealine, cần cải thiện thêm về typography\r\n- Thiết kế đúng trọng tâm nội dung\r\n- Có sáng tạo trong trình bày bố cục và nội dung\r\n- Trước hạn, có cố gắng','Công việc được giao:\r\n- Thiết kế Social media post Facebook\r\n- Chỉnh sửa thiết kế cũ trên Website\r\n- Chỉnh sửa ảnh, định dạng cho phù hợp với Facebook\r\n- Đảm nhận thiết kế ảnh cho chiến dịch \"Meme trung thu\"\r\n\r\nNội dung - kết quả đạt được:\r\n- Hoàn thành 11 bài thiết kế\r\n- Tìm hiểu, đọc nội dung yêu cầu thiết kế, họp và trao đổi với bộ phận content vê chiến dịch\r\n\r\nNhận xét của người hướng dẫn:\r\n- Hoàn thành và nắm bắt thông điệp tốt, bố cục sắp xếp ổn, màu sắc cần cải thiện thêm\r\n- Có sự tìm tòi và tổng hợp hình ảnh\r\n- Hình ảnh bánh trung thu đúng insight khách hàng\r\n- Hình ảnh có sự sáng tạo bắt mắt','Công việc được giao:\r\n- Thiết kế Social media post Facebook\r\n- Chỉnh sửa ảnh, định dạng cho phù hợp với Facebook\r\n\r\nNội dung - kết quả đạt được:\r\n- Hoàn thành 5 bài thiết kế\r\n- Tự chuẩn bị hình ảnh cho những bài post không có ảnh sẵn\r\n\r\nNhận xét của người hướng dẫn:\r\n- Đúng thời hạn được giao, có sáng tạo trong ấn phẩm, cần chú trọn sắp xếp thời gian để tránh bị ngộp trong công việc\r\n- Thiết kế có sáng tạo theo yêu cầu được giao\r\n- Làm đúng trọng tâm, cần sắp xếp thời gian hợp lý hơn\r\n- Tốt, đáng khen',NULL,NULL,388,388,NULL,'2021-11-18 12:32:07','2021-11-18 13:10:17'),(415,77,'09/08/2021','15/08/2021','Làm file báo cáo exel các sản phẩm nhập kho cho khách hàng theo biểu mẫu có sẵn \r\nkết quả đạt được:Làm được hoàn cỉnh file báo cáo, hoàn thành tốt công việc được giao','Nghỉ làm việc tại nhà do điều kiện dịch bệnh diễn biến phức tạp nên chuyển sang làm online','Setup tối ưu hoá hệ thống mạng lan các máy tính công ty\r\nkết quả đạt được: Loại bỏ các dây mạng cũ hư hỏng không dùng tới, thiết kế lại đường đi của dây mạng thẩm mỹ hơn','Nghỉ làm việc tại nhà do điều kiện dịch bệnh diễn biến phức tạp nên chuyển sang làm online','Phụ việc nhập dữ liệu khách hàng cho công ty\r\nkết quả: Hoàn thành tốt công việc được giao','Nhập dữ liệu khách hàng đặt lịch hoạc hoãn chăm sóc do dịch không đến được.',NULL,NULL,357,357,NULL,'2021-11-18 12:36:09','2021-11-18 12:39:07'),(416,77,'16/08/2021','22/08/2021','Phụ sắp xếp, dọn dẹ