ter)\r\n- Nội dung – kết quả đạt được:\r\n+ Tiến hành làm poster thứ 2 (dung dịch thanh lọc da đầu Thủ Đạo Thang)\r\n+ Phát thảo bố cục ra giấy\r\n+ Sử dụng các mảng màu để làm background, sử dụng mảng màu để làm nổi bật sản phẩm\r\n+ Nhập đầy đủ nội dung của sản phẩm\r\n+ Sử dụng các đưởng nét để làm nổi bật các nội dung như: Công dụng, thành phần, cách sử dụng,…\r\n+ Hoàn thành poster thứ 2','- Công việc được giao: Thiết kế poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang (4 poster)\r\n- Nội dung – kết quả đạt được:\r\n+ Tiến hành làm poster thứ 3 (tinh chất phục hồi tơ tằm Thủ Đạo Thang)\r\n+ Phác thảo bố cục ra giấy\r\n+ Tạo background màu\r\n+ Sử dụng mảng màu làm nổi bật sản phẩm, sử dụng khung để bao quát nội dung của sản phẩm\r\n+ Nhập đầy đủ nội dung của sẩn phẩm\r\n+ Hoàn thành poster thứ 3','- Công việc được giao: Thiết kế poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang (4 poster)\r\n- Nội dung – kết quả đạt được:\r\n+ Tiến hành làm poster tổng thể (gồm 3 sản phẩm)\r\n+ Phác thảo bố cục ra giấy\r\n+ Tạo background bằng nét màu\r\n+ Sử dụng mảng màu để làm nổi bật nội dung, sử dụng đường elip đứt để bao gồm các sản phẩm bên trong\r\n+ Nhập đầy đủ nội dung\r\n+ Hoàn thành poster tổng thể\r\n+ Xuất tất cả poster dưới dạng pdf và hình ảnh để nộp cho người hướng dẫn','- Công việc được giao: Thiết kế poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang (4 poster)\r\n- Nội dung – kết quả đạt được: Người hướng dẫn nhận xét và đưa ra những điểm cần chỉnh sửa\r\n- Nhận xét: Poster 1,2 bố cục, màu sắc ổn ko cần chỉnh sửa, poster 3 cần đơn giản lại chỗ giá tiền, poster tổng thể còn hơn đơn điệu cần chỉnh sửa ở phần tiêu đề và giá cả\r\n- Yêu cầu: chỉnh sửa lại poster 3, poster tổng thể, hạn chót là thứ 4 tuần sau','- Công việc được giao: Thiết kế poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang (4 poster)\r\n- Nội dung – kết quả đạt được: \r\n+ Chỉnh sửa poster 3\r\n+ Bỏ đường nét phía dưới “giá chỉ”, thay bằng 1 mảng màu để làm n