được giao:\r\n1.	Thiết kế Tem Kích thước tròn 5cm - Tên nhãn hàng là AN TUỆ\r\n2.	Thiết kế name card cho Shop Áo Dài Kích thước: 90x55mm\r\n\r\nNội dung – kết quả đạt được:\r\nThiết kế được ba mẫu nhãn .\r\nHai mẫu card.\r\n\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\nChú ý suất file mỗi trang một hình.\r\nThiết kế thêm các option khác ,các mẫu thiết kế hơi rối với chưa có điểm nhấn .','Công việc được giao:\r\n1.	Thiết kế Tem Kích thước tròn 5cm - Tên nhãn hàng là AN TUỆ\r\n2.	Thiết kế name card cho Shop Áo Dài Kích thước: 90x55mm\r\n3.	Họp để sữa bài và chia sẽ khinh nghiệm.\r\n\r\nNội dung – kết quả đạt được:\r\nThiết ké được 3 option nhãn.\r\n\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\nMẫu hoa văn sủ dụng hơi rối\r\nCần tìm backgroup đơn giãn nhưng tạo điểm nhấn.\r\nSắp sếp chính phụ ,chính trước và phải bật lên trước.','Công việc được giao:\r\n1.	Thiết kế Tem Kích thước tròn 5cm - Tên nhãn hàng là AN TUỆ\r\n2.	Thiết kế name card cho Shop Áo Dài Kích thước: 90x55mm\r\n\r\nNội dung – kết quả đạt được:\r\nTiếp tục chỉnh sữa các option.\r\nVà thiết kế thêm các option.\r\n\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:','Công việc được giao:\r\n1.	Thiết kế Tem Kích thước tròn 5cm - Tên nhãn hàng là AN TUỆ\r\n2.	Thiết kế name card cho Shop Áo Dài Kích thước: 90x55mm\r\n\r\nNội dung – kết quả đạt được:\r\nThiết kế được hai option nhãn .\r\nMột option card.\r\n\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:','Công việc được giao:\r\n1.	Thiết kế Tem Kích thước tròn 5cm - Tên nhãn hàng là AN TUỆ\r\n2.	Thiết kế name card cho Shop Áo Dài Kích thước: 90x55mm\r\n\r\nNội dung – kết quả đạt được:\r\nThiết kế được hai option card.\r\n\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:','Công việc được giao:\r\n1.	Thiết kế Tem Kích thước tròn 5cm - Tên nhãn hàng là AN TUỆ\r\n2.	Thiết kế name card cho Shop Áo Dài Kích thước: 90x55mm\r\n\r\nNội dung – kết quả đạt được:\r\nChỉnh sữa hai option trên.\r\n\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\nChỉnh sữa lại bỉ hoa văn trên hàng địa chỉ\r\nThay font chữ hàng hướng dẫn sử dụng giống hàng địa chỉ và chỉ in hoa hàng đầu tiên.\r\nMặt trước front khó đọc quá cần đổi font.',NULL,NULL,363,363,NULL,'2021-11-19 19:48:49','2021-11-19 20:12:13'),(496,188,'16/8/2021','22/8/2021','Công việc được giao:\r\n1.	Làm lại mẫu \r\nVẽ logo và dàn lên hộp.\r\n\r\nNội dung – kết quả đạt được:\r\nCô hướng dẫn vẽ hộp và dàn lên hộp.\r\nHoàn thành logo và dàn được lên hộp.\r\nHai mẫu card.\r\n\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\nChú ý gửi file do là bài làm lại theo mẫu nên phải nộp file vector.','Công việc được giao:\r\n1.	Làm lại mẫu \r\nVẽ logo và dàn lên hộp.\r\n\r\nNội dung – kết quả đạt được:\r\nđang hoàn thành bài','Công việc được giao:\r\n1.	Làm lại mẫu \r\nVẽ logo và dàn lên hộp.\r\n\r\nNội dung – kết quả đạt được:\r\nđang hoàn thành bài','Công việc được giao:\r\n1.	Làm lại mẫu \r\nVẽ logo và dàn lên hộp.\r\n\r\nNội dung – kết quả đạt được:\r\nVẽ lại logo rồi dàn lên hộp rồi cô hướng dẫn.\r\nVẽ lai logo và dàn lên hộp nộp lại cô.\r\n\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\nChú ý kiểm tra :logo –font chữ -nét chữ cho đúng.\r\nVì bài làm lại theo mẫu nên cần đúng chính xác ,vì logo khách đã có chớ không phải thiết kế lại.','Cô không gia bài','Công việc được giao:\r\n1.	Làm lại mẫu card madacamia \r\n\r\nNội dung – kết quả đạt được:\r\nVẽ lại được mẫu nộp cô.\r\n\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\nXem lại màu sắc , hình hạt macca không được sắc nét,kiểm tra font chữ.\r\nMàu sắc trong mẫu khách đưa không đúng ,mình sẽ làm lại và chỉnh màu sao cho tương đối trước khi gửi .Sau đó nếu có phản hồi mình xẽ chỉnh lại thêm.\r\nMình chủ động tự xử lý để mẫu đạt.',NULL,NULL,363,363,NULL,'2021-11-19 19:56:31','2021-11-19 20:13:48'),(497,188,'23/8/2021','29/8/2021','Cô không giao bài','Cô không giao bài','Cô không giao bài','Cô không giao bài','Cô không gi